eux. Ainsi, les utilisateurs à la maison, au bureau, au sein du groupe de travail ou d\'un environnement de création multimédia peuvent aujourd’hui transférer plus rapidement les fichiers gourmands en bande passante. Transférez des fichiers graphiques, CGI, CAD ou multimédia instantanément sur le réseau.Facile à utiliserLes fonctions automatisées de ce switch Gigabit assurent une installation rapide et facile. Aucune configuration n\'est requise. La fonction Auto MDI/MDX permet de s\'affranchir des câbles croisés. L\'auto-négociation sur chaque port détecte la vitesse de connexion d\'un appareil sur le réseau (10, 100 ou 1000 Mbps) et l\'ajuste intelligemment pour une meilleure compatibilité et des performances optimales.5 ports RJ45 Gigabit auto-négociation, fonction Auto MDI/MDXTechnologie Green Ethernet pour plus d\'économie d’énergieContrôle de flux IEEE 802.3x garantissant l\'intégrité des données Boîtier plastique conçu pour être installé sur un bureau ou accroché au murPlug-and-Play, aucune configuration requiseGarantie 3 ans'),('941896','Poids brut','0,43 kg'),('942395','Informations complémentaires','Câble HDMI 2m Plat'),('942398','Informations complémentaires','Câble HDMI /mini HDMI 1.5m'),('942432','Type','Lot de 2 piles A23 LRV08 DURACELL SECURITY'),('942432','Nombre de piles','2'),('942436','Type','Piles DURACELL'),('942436','Rechargeable','Non'),('942436','Nombre de piles','2'),('942438','Type','Lot de 2 piles CR2025 DURACELL Electronics'),('942438','Nombre de piles','2'),('942642','Amplification (dB)','8 dB'),('942642','Nombre d\'éléments','9'),('942642','Poids net','1 kg'),('942642','Poids brut','1,3 kg'),('942642','Dimensions colis','H 32 cm x L 7 cm x P 104 cm'),('942642','Informations complémentaires','Réception facile. Connexion à fiche F. Panneau anti-échos. Polarisation horizontale ou verticale. Montage rapide.Découvrir notre Marque et nos Produits Edenwood'),('942680','Connectiques','Jack 6,35mm mâle, XLR femelle'),('942680','Descriptif complé