nt de connecter deux appareils simultanément.Compatible avec toutes les box du marché, et routeurs/points d\'accès WiFi Extension de la portée WiFi d\'un simple appui sur le bouton WiFi CloneConfiguration simplifiée de votre réseau WiFi pour un réseau domestique unifié sans difficultésExtension de portée WiFi instantanéeAvec son bouton de clonage WiFi permettant d\'étendre la couverture réseau, le TL-WPA4225 peut copier automatiquement le nom du réseau sans fil (SSID) et le mot de passe de votre routeur à la simple pression d\'un bouton. Après avoir appuyé sur le bouton, vous pouvez placer le CPL où vous avez besoin d\'un accès filaire ou WiFi et profiter d\'un réseau homogène à votre domicile ou votre bureau.Débit CPL : jusqu\'à 600 Mbps - Idéal pour les vidéos HDAvec la technologie évoluée HomePlug AV, le TL-WPA4225 KIT fournit, un débit CPL stable allant jusqu\'à 600 Mbps sur une longueur de 300 mètres. Il est un excellent choix pour une solution d\'interconnexion des : ordinateurs, consoles de jeux, décodeurs TV, imprimantes et NAS à domicile comme au bureau.'),('949425','Dimensions produit','H 9,4 cm x L 5,8 cm x P 4,2 cm'),('949425','Dimensions colis','H 9,8 cm x L 13,5 cm x P 21,2 cm'),('949425','Poids brut','0,61 kg'),('949454','Connectiques','jack 6.5mm'),('949454','Adaptateur fourni','Non'),('949454','Alimentation','0'),('949454','Prise micro','Non'),('949454','Dimensions produit','H 39 cm x L 3 cm x P 3 cm'),('949454','Poids net','0,55 kg'),('949454','Coloris','Noir'),('949467','Type jeu de lumière','Par LED'),('949467','Descriptif complémentaire','60000 HrsDMX 512 - 8 CHSMusique et vitesse réglableCable DMX non fourni'),('949467','Informations complémentaires','Découvrir notre Marque et nos Produits Novistar'),('949467','Dimensions produit','H 12 cm x L 12 cm x P 16 cm'),('949467','Dimensions colis','H 32 cm x L 24 cm x P 36 cm'),('949467','Poids net','7,2 kg'),('949467','Certificat de conformité','Télécharger le certificat de conformité'),('949584','Réf