','Blanc'),('951399','Poids net','7,7 kg'),('951399','Poids brut','7,7 kg'),('951399','Dimensions colis','H 32,1 cm x L 30,3 cm x P 53,6 cm'),('951399','Dimensions produit','H 11 cm x L 22 cm x P 26 cm'),('951399','Informations complémentaires','Découvrir notre Marque et nos Produits Edenwood'),('951399','Certificat de conformité','Télécharger le certificat de conformité'),('951412','Type','Switch Ethernet'),('951412','Débit maximal théorique (Mbps)','100'),('951412','Normes Wifi supportées','Non équipé'),('951412','Fréquence(s)','Non équipé'),('951412','Nombre de Ports Ethernet','5'),('951412','Dimensions produit','H 3 cm x L 14 cm x P 8,5 cm'),('951412','Dimensions colis','H 3,8 cm x L 5,2 cm x P 3,3 cm'),('951412','Informations complémentaires','5 ports RJ45 auto-négociation 10/100 Mbps avec prise en charge Auto MDI/MDIXTechnologie Green Ethernet pour plus d\'économie d’énergieContrôle de flux IEEE 802.3x garantissant l\'intégrité des données Boîtier plastique conçu pour être installé sur un bureau Plug-and-Play, aucune configuration requiseFonctionsLe switch Fast Ethernet TL-SF1005D est destiné aux utilisateurs SOHO (Small Office/Home Office) et aux groupes de travail. Les 5 ports sont compatibles Auto MDI/MDIX, nul besoin de vous soucier des types de câbles : vous branchez et ça marche. De plus, grâce à la technologie innovante d’économie d’énergie, le TL-SF1005D permet d’économiser jusqu’à 60 %* de consommation électrique tandis que 80 % des matériaux d\'emballage sont recyclables pour en faire une solution respectueuse de l’environnement intégrée à votre réseau professionnel.Hautes performancesLe switch Fast Ethernet TL-SF1005D est doté de 5 ports RJ45 10/100 Mbps auto-négociés. Tous les ports supportent la fonction Auto MDI/MDIX, éliminant ainsi le recours à des câbles croisés ou des ports Uplink. De par son architecture de commutation sans blocage, le TL-SF1005D redirige et filtre les paquets à pleine vitesse pour un transfert optimal. L\'utilisation de trames Jumbo de 10 K améliore considérablement les performances de transfert des fichiers volumineux. Le contrôle de flux IEEE 802.3x pour le mode de liaison bidirectionnelle simultanée et la fonction Backpressure pour le mode de liaison bidirectionnelle alternée réduisent l’encombrement du trafic et rendent le TL-SF1005D fiable.Facile à utiliserLes fonctions automatisées de ce switch Gigabit assurent une installation rapide et facile. Aucune configuration n\'est requise. La fonction Auto MDI/MDX permet de s\'affranchir des câbles croisés. L\'auto-négociation sur chaque port détecte la vitesse de connexion d\'un appareil sur le réseau (10 ou 100 Mbps) et l\'ajuste intelligemment pour une meilleure compatibilité et des performances optimales.'),('951412','Poids brut','0,45 kg'),('951510','Type de produit','Set de casseroles'),('951510','Coloris','Plusieurs coloris'),('951510','Descriptif coloris','Noir, Noir mat, Gris mat, Coloris aléatoire si VAD'),('951510','Diamètre (cm)','16 18 20 cm'),('951510','Matériau','Aluminium'),('951510','Revêtement','Anti-adhérent sans PFOA'),('951510','Manche amovible','Oui'),('951510','Compatibilité','Tous feux dont induction'),('951510','Lavable en lave-vaisselle','Oui'),('951510','Descriptif complémentaire','Passage au lave vaisselle sauf poignée'),('951510','Dimensions produit','H 9 cm x L 20 cm x P 20 cm'),('951510','Dimensions colis','H 12 cm x L 22 cm x P 26 cm'),('951510','Poids net','1,4 kg'),('951510','Poids brut','1,8 kg'),('951567','Type','Ecouteurs intra-auriculaires'),('951567','Plage de fréquence','20 - 20 kHz'),('951567','Longueur du câble','1,2 m'),('951567','Micro intégré','Non'),('951567','Microphone','Non'),('951567','Télécommande intégrée','Non'),('951567','Kit mains-libres','Non'),('951567','Poids net','0,01 kg'),('951567','Coloris','Blanc'),('951567','Dimensions produit','H 17,5 cm x L 2,5 cm x P 2,5 cm'),('951567','Informations complémentaires','Grâce à leur design fun et coloré, ces écouteurs stéréo de la collectio