La technologie sans scintillement de Philips utilise une nouvelle solution qui permet de régler la luminosité et de réduire le scintillement pour un meilleur confort visuel. Mode LowBlue : Reduction lumière bleueDes études ont démontré que, tout comme les rayons ultraviolets, les rayons de lumière bleue à courte longueur d\'onde émis par les écrans LED peuvent causer des lésions oculaires et avoir un effet négatif sur la vue à long terme. Développé pour votre bien-être, le mode LowBlue de Philips utilise une technologie logicielle intelligente pour réduire la lumière bleue à courte longueur d\'onde nocive.Technologie IPSLes écrans IPS utilisent une technologie avancée qui élargit l\'angle de vue à 178/178 degrés, ce qui permet de regarder l\'écran depuis quasiment n\'importe quel angle. Contrairement aux dalles traditionnelles, les écrans IPS produisent des images incroyablement nettes aux couleurs éclatantes, idéales pour les photos, les vidéos, la navigation Web, mais aussi pour les applications professionnelles qui nécessitent des couleurs précises et une luminosité constante en permanence. Cadre ultra-fin :Le nouveau moniteur Philips est doté d\'un cadre ultra-fin, pour un affichage aussi grand que possible. Particulièrement adapté à une installation multi-écran ou en mosaïque, que ce soit pour des jeux, du graphisme ou des applications professionnelles, l\'écran à cadre ultra-fin vous donnera l\'impression d\'utiliser un seul grand écran. Smartimage :SmartImage est une technologie de pointe, exclusivité Philips, qui analyse le contenu affiché à l\'écran pour un rendu optimal. Cette interface intuitive vous permet de sélectionner différents modes, notamment bureau, photo, film, jeu, économie, etc. en fonction de l\'application que vous utilisez. Selon cette sélection, SmartImage optimise automatiquement le contraste, la saturation et la netteté des images et vidéo pour un rendu parfait. Le mode économie vous permet pour sa part de réaliser d\'importantes économies. Et tout ça d\'une simple pression sur un bouton !'),('956975','Descriptif complémentaire','Bords fins, mode réduction lumière bleueFixation VESA (100x100MM)'),('956975','Dimensions produit','H 45,3 dam x L 61,2 cm x P 22,7 cm'),('956975','Dimensions colis','H 45,2 cm x L 13,4 cm x P 66,4 cm'),('956975','Disponibilité pièces détachées (données fournisseur)','5 ans date de fabrication'),('954115','Type de produit','Moule à manqué'),('954115','Matière','Silicone'),('954115','Compatible lave-vaisselle','Oui'),('954115','Coloris','Plusieurs coloris'),('954115','Descriptif coloris','noir gris framboise vert d\'eau'),('954115','Dimensions produit','H 5 cm x L 26 cm x P 26 cm'),('954115','Dimensions colis','H 5 cm x L 26 cm x P 30 cm'),('954115','Poids brut','0,132 kg'),('954116','Type de produit','Moule à tarte'),('954116','Matière','Silicone'),('954116','Compatible lave-vaisselle','Oui'),('954116','Coloris','Plusieurs coloris'),('954116','Descriptif coloris','noir gris framboise vert d\'eau'),('954116','Dimensions produit','H 3,5 cm x L 25 cm x P 25 cm'),('954116','Dimensions colis','H 3,5 cm x L 27,5 cm x P 30 cm'),('954116','Poids brut','0,142 kg'),('954119','Type de produit','Moule cannelés'),('954119','Matière','Silicone'),('954119','Compatible lave-vaisselle','Oui'),('954119','Coloris','Plusieurs coloris'),('954119','Descriptif coloris','Noir gris framboise vert d\'eau'),('954119','Dimensions produit','H 29,5 cm x L 4,5 cm x P 17,5 cm'),('954119','Dimensions colis','H 29,5 cm x L 4,5 cm x P 17,5 cm'),('954119','Poids brut','0,135 kg'),('955435','Type d\'appareil','Lisseur'),('955435','Puissance (W)','25 W'),('955435','Largeur des plaques','1,5 cm'),('955435','Revêtement des plaques','Céramique'),('955435','Réglage de la température','Non'),('955435','Prêt en','NC'),('955435','Température minimale (°C)','180°C'),('955435','Température maximale (°C)','180°C'),('955435','Accessoires','NC'),('955435','Descriptif complémentaire','ideal mèches, retouches, frange, cheve