avec la peau'),('958198','Descriptif complémentaire','Etanche pour vous épilez sous la douche.Technologie sensosmart qui vous assure une pression adéquate'),('958198','Informations complémentaires','Le kit de démarrage avec l’épilateur Braun Silk-épil 5 Wet & Dry retire les poils courts que la cire ne peut pas attraper, pour une peau douce jusqu’à 4 semaines. Idéale pour les débutantes, la technologie SensoSmart innovante vous guide lors de l’épilation pour appliquer la pression idéale, et permet de retirer ainsi encore plus de poils en un seul passage¹. Sans fil et 100 % étanche, l’épilateur peut être utilisé dans le bain ou sous la douche, pour une épilation en douceur. Avec 2 accessoires incluant des rouleaux de massage et un accessoire de contact avec la peau.SensoSmart™Un capteur intelligent innovant guide votre épilation : il s’assure qu’une pression adéquate est appliquée sur la peau afin de permettre de retirer encore plus de poils à chaque passage.Le confort de la technologie Wet & DryDans votre bain ou sous votre douche, l’eau chaude vous aide à vous détendre ce qui rend l’épilation encore plus confortable.Accessoire de contact avec la peauAmélioration de la prise en main et de l’adaptation à toutes les zones du corps.Système de massage haute fréquenceStimule la peau pour une épilation plus confortable.Ne perdez jamais le contrôleAvec le grip antidérapant. Facile à contrôler, même dans des conditions humides.Batterie longue duréeRechargement complet en 1 heure pour une autonomie de 30 minutes. Utilisation sans fil sous la douche ou dans le bain.2 réglages de vitesseVitesse 1 pour une épilation ultra-douce, vitesse 2 pour une épilation ultra-efficace.100 % étancheSe nettoie facilement à l’eau courante et s’utilise sans souci dans le bain ou sous la douche.'),('958198','Dimensions colis','H 19,7 cm x L 6,5 cm x P 18 cm'),('958198','Poids net','0,4 kg'),('958198','Disponibilité pièces détachées (données fournisseur)','5 ans date d\'achat'),('958827','Fonction