,'110 cm'),('960623','Revêtement des plaques','Céramique et Keratine'),('960623','Réglage de la température','Oui'),('960623','Prêt en','15s'),('960623','Température minimale (°C)','160°C'),('960623','Température maximale (°C)','230°C'),('960623','Accessoires','Tapis thermo-resistant'),('960623','Descriptif complémentaire','Revêtement Céramique haute qualité à la kératineEcran digital'),('960623','Informations complémentaires','Taille des plaques : Etroites, largeur 1,1cm - idéal pour cheveux courts / retouches et mi longsRevêtement : Céramique et KératineLa température : de 160°C à 230°C - idéal pour cheveux fins, normaux, ondulés et épaisRevêtement Céramique haute qualité à la kératineLa technologie de protection par la kératine est employée de manière exclusive au niveau du lisseur Keratin Therapy. Ses plaques de coiffure sont équipées d\'un revêtement Céramique de haute qualité, enrichi de microcomposants actifs de kératine activées par la chaleur.Keratin Therapy – pour une coiffure sans compromisLe lisseur Keratin Therapy Pro S8590 offre, grâce à une technologie unique au monde de protection par la kératine, jusqu\'à 57 % de protection supplémentaire contre la cassure et les autres dommages des cheveux (comparé à un lisseur REMINGTON standard disposant d\'un revêtement Céramique standard - testé sur des cheveux bruns européens).Capteur de protection contre la chaleurLe capteur exclusif de protection contre la chaleur présent dans la plaque supérieure enregistre régulièrement le niveau d\'humidité des cheveux, et optimise la température pour protéger les cheveux.Pochette de protection résistant à la chaleurLe lisseur Keratin Therapy Pro, avec son design élégant, est vendu avec une pochette de protection thermorésistante.'),('960623','Dimensions colis','H 16 cm x L 8,5 cm x P 38 cm'),('960623','Poids brut','0,85 kg'),('960625','Type de réfrigérateur','Réfrigérateur congélateur haut'),('960625','Coloris','Platinium'),('960625','Volume utile total (L)','362 L'),('9