A'),('960649','Bluetooth','Oui'),('960649','NFC','Non'),('960649','Dimensions du bloc (LxHxP)','510 x 775 x 503 mm'),('960649','Poids net','45,4 kg'),('960649','Informations complémentaires','Basses puissantesQuand un DJ veut vraiment laisser sa marque, c’est dans les basses que tout se joue. Ce puissant système est en mesure de produire des basses fréquences retentissantes et tonitruantes à l’aide de son massif haut-parleur de graves de 15 pouces, pourdes basses qui se ressentent autant qu’elles s’entendent.Accélérateur de fêteSurvoltez la fête avec l\'Accélérateur de fête. Poussez la manette vers l\'avant pour entendre le son monter jusqu\'à ce qu\'il culmine en un boum tonitruant accompagné d\'un jeu de lumière délirant.Créateur de karaokéPréparez-vous à chanter : Cette fonction supprime les fréquences vocales d\'une chanson pour que tout le monde puisse l\'interpréter comme une vedette! Elle peut même changer la tonalité d\'une chanson afin qu\'elle s\'agence mieux à la voix du chanteur.Entrées multiplesLa bonne musique peut provenir d’une variété de sources. Ce système de haut-parleurs est donc équipé d’une entrée auxiliaire stéréo analogique standard ainsi que d’un port USB, prêts à accueillir un lecteur externe pour lire des fichiers musicaux numériques en toute simplicité.Éclairage de fêteQu\'est-ce qui donne encore plus envie de danser? Le bon éclairage! Ce système offre une variété d\'effets exaltants, dont le double stroboscope et l\'éclairage de danse qui laisse la lumière pulser au rythme de la musique, de sorte que tout le monde puisse voir le rythme en plus de l\'entendre.Filtres vocauxLa fonction karaoké comprend des filtres intégrés qui améliorent le son de la voix pour transformer chaque chanteur en vedette. Ils peuvent même modifier complètement les voix pour ajouter une touche rigolote.Livrée avec :Télécommande (avec piles)Antenne FM Batterie AAAX2NoticeCâble d\'enceinte'),('960649','Dimensions produit','H 77,4 cm x L 51 cm x P 50,3 cm'),('959717