a pression sur votre crâne, tandis que sa texture extérieure facilite la prise. Pour vous aider à trouver le port parfait, ils possèdent également un serre-tête souple et durable, et un pivot flexible.'),('961753','Disponibilité pièces détachées (données fournisseur)','2 ans date d\'achat'),('961754','Dimensions produit','H 26,1 cm x L 8,3 cm x P 25,7 cm'),('961754','Poids net','0,319 kg'),('961754','Coloris','Rouge'),('961754','Informations complémentaires','TECHNOLOGIE SANS FILAllumez et repérez votre appareil Bluetooth pour commencer à écouter votre musique. Vous pourrez profiter d\'environ 20 heures de lecture après une charge de 3 heures, mais si vous utilisez votre casque pour le monitoring DJ ou que vous oubliez simplement de le recharger (on est tous passés par là), vous pouvez également utiliser le câble enroulé d\'1,2 m qui est fourni. Grâce à son micro intégré, vous pouvez également parler les mains libre quand le casque est connecté à votre téléphone.UN SON EXTRÊMEMENT CLAIREntendez chaque nuance de vos beats avec la meilleure qualité sonore possible grâce au codec audio aptX de Qualcomm® et aux AAC et SBC. Un tuning équilibré et des chambres Bass Reflex permettent une excellente isolation acoustique et une superbe réponse dans les basses, pour que vous ne manquiez rien de votre musique.PORT CONFORTABLECes casques sont confortables à utiliser quelle que soit la manière dont vous les portiez. Le design de la structure est conçu pour réduire la pression sur votre crâne, tandis que sa texture extérieure facilite la prise. Pour vous aider à trouver le port parfait, ils possèdent également un serre-tête souple et durable, et un pivot flexible.'),('961754','Disponibilité pièces détachées (données fournisseur)','2 ans date d\'achat'),('961755','Descriptif complémentaire','Casque pliant pour un gain de place et facilité de transport'),('961755','Dimensions produit','H 26,1 cm x L 8,3 cm x P 25,7 cm'),('961755','Poids net','0,319 kg'),('961755','Coloris','Blanc')