t','H 5 cm x L 22 cm x P 30 cm'),('960819','Dimensions colis','H 5 cm x L 24 cm x P 31,5 cm'),('960819','Poids brut','0,55 kg'),('961757','Type d\'enceinte amplifiée','Enceinte active sur secteur'),('961757','Puissance (W)','42 W'),('961757','Impédance (ohm)','4'),('961757','Jack 6.4 mm','1'),('961757','Bluetooth','Oui'),('961757','RCA','1'),('961757','USB','Non'),('961757','Prise micro','Non'),('961757','Sortie Casque','1'),('961757','Lecteur de cartes SD','0'),('961757','Informations complémentaires','CONNEXION BLUETOOTHLa technologie Bluetooth® vous permet de lire vos morceaux sans fil depuis des smartphones et tablettes, et, avec la compatibilité Qualcomm aptX et AAC, vous pouvez profiter d\'une reproduction sonore de qualité encore meillleure.SYSTÈME BASS REFLEX CHARGÉ SUR LE DEVANTDes woofers 4 pouces en fibre de verre libèrent des basses puissantes et percutantes par l\'avant, tandis que les évents, sur les conduits, réduisent les frottements de l\'air. Vous sentirez ainsi la pulsion tendue des basses même quand les moniteurs sont placés contre le mur.SON STÉRÉO 3DLes tweeters 3/4 de pouces à dômes souples des DM-40BT sont équipés de diffuseurs convexes DECO qui acheminent les aigus dans toutes les directions, délivrant ainsi un sweet spot large et un son stéréo 3D où que vous soyez, aussi bien assis que debout.ALIGNEMENT TEMPORELDes amplificateurs Classe AB permettent de délivrer un son extrêmement clair avec une faible distorsion. De plus, le tweeter et le woofer sont soigneusement alignés pour éliminer le crossover et assurer une réponse bien équilibrée sur toutes les fréquences.DESIGN INTELLIGENTLe devant incurvé du caisson offre une rigidité maximale et une résonance minimale pour un son propre à tous les volumes – en plus d’ajouter du style à ces enceintes qui trouveront parfaitement leur place dans votre intérieur.'),('961757','Dimensions produit','H 34,3 cm x L 27,3 cm x P 39,7 cm'),('961757','Poids net','4,9 kg'),('961757','Coloris','Noir'),('961757'