ir.Illuminez votre fêteDonnez la touche finale à votre fête grâce aux caissons de basse à éclairages multicolores, qui changent en fonction du rythme de la musique. Les doubles bandes blanches brillantes et les coins illuminés en rouge et en bleu apportent une touche supplémentaire de fun à la fête.La musique, n’importe où et n’importe quandÉcoutez de la musique où que vous soyez avec le LG XBOOM OK99. Attrapez les poignées et faites rouler votre enceinte là où vous en avez besoin.Réveillez le DJ qui sommeille en vousDevenez DJ grâce aux fonctions Pro DJ. Tournez les platines pour scratcher et ajoutez bien d’autres effets, en plus de pouvoir jouer en boucle une partie du morceau en appuyant simplement sur un bouton. Donnez un coup d’accélérateur à votre fêteFaites monter la tension grâce au contrôleur Party Accelerator. Il suffit de pousser l’accélérateur pour voir la fête battre son plein grâce à un son puissant et des éclairages déments.  Lisez et mixez des morceaux provenant de deux supports USB différents. Grâce à la fonctionnalité DJ Sharing, vous pouvez envoyer facilement les morceaux que vous avez mixés pour la fête sur votre téléphone.'),('961601','Dimensions produit','H 114 cm x L 50,8 cm x P 47,8 cm'),('961827','Fonctions de la chaîne','CD, FM, AUXin, USB, BLUETOOTH'),('961827','Puissance','40'),('961827','Compatibilité','cd / cd-r / cd-rw / mp3 / usb'),('961827','Tuner radio','Radio FM PLL'),('961827','Télécommande','Oui'),('961827','Connectiques','Bluetooth, AUX in (3.5mm), USB'),('961827','Bluetooth','Oui'),('961827','NFC','Non'),('961827','Poids net','3,7 kg'),('961827','Informations complémentaires','Réglage du son par 6 modes d\'égalisation différentsÉcran LCD avec rétro-éclairage blancEnceintes en bois pour une expérience sonore exceptionnelle'),('961827','Dimensions produit','H 14 cm x L 54,5 cm x P 44,5 cm'),('961827','Disponibilité pièces détachées (données fournisseur)','42 mois date de fabrication'),('961832','Type de chauffage','Bain d\'huile'