nnexion fiable – 2 antennes externes pour une couverture Wi-Fioptimale et des connexions Wi-Fi fiablesDébit Wi-Fi ultime – Vitesse Wi-Fi combinée allant jusqu’à300 Mbps (en 2.4 GHz) et 433 Mbps (en 5 GHz)· Support 802.11 ac – Fournit un taux de transfert de données3 fois plus rapide que 802.11n pour chaque flux· Mode haut débit – Utilise une bande Wi-Fi dédiée pour augmenterles performances du répéteur pour les jeux en ligne / vidéo 4KUI Web Intuitive – Assure une installation rapide et simple sanstracas· Chiffrement rapide – Chiffrement de sécurité Wi-Fi WPA en unetouche avec le bouton WPS· Gestion simple avec l’application Tether – La gestion du réseauest facilitée grâce à l’application TP-Link Tether, disponible surn’importe quel appareil Android ou iOS'),('962633','Poids brut','0,24 kg'),('962635','Type de produit','Sync et câble de chargement'),('962635','Coloris','Blanc'),('962635','Dimensions produit','H 10 mm x L 245 mm x P 20 mm'),('962635','Poids net','60 g'),('962638','Descriptif complémentaire','- Station d’accueil pour Game pad avec HUB 4 x USB- Bouton : marche/arrêt (programmable pour éclairage RGB coloré) via port USB- Accessoires : support de casque, support de gobelet- Pieds : réglable et ajustable à niveau- Dimensions: 1200*640*750 mm- Poids : 18.50 kg'),('962638','Informations complémentaires','Parce qu’un setup Gaming ce n’est pas qu’un ordinateur, nous avons préparé pour vous le meilleur des bureaux pour réaliser vos exploits in game !Découvrez le bureau gaming BALDER par Berserker spécialement conçu pour vos sessions de jeu pour un confort optimal. Si son design agressif vous laisse pantois, sachez que rien n’a été laissé au hasard et qu’en termes de fonctionnalités, il est à la hauteur de son look. Ce bureau arbore une surface à la texture fibre de carbone et des rebords latéraux et ABS rétroéclairé LED (alimentation via usb, bouton marche/arrêt) pour renforcer le contour du plateau ! Pour la structure, ce dernier est composé d’acier et d’un alliage d’aluminium.Bâti en « Z », ce bureau offrira amplement d’espace pour vos jambes. Par ailleurs, ses pieds aluminium sont réglables et ajustables au niveau afin que vous puissiez choisir LA hauteur qui vous correspond le mieux… Et petite touche de détente appréciable, un repose gobelet a été prévu pour votre confort : adieu la gêne du verre sur le bureau et la peur d’un renversement accidentel !Et parce que rien n’est assez bien pour votre setup, le Balder dispose d’un passe câble sur le côté supérieur droit, d’un coffret électrique sur la partie opposée joueur et d’un repose casque côté inférieur gauche qui vous permettront de ne pas laisser câbles et matériel traîner sur le bureau !A découvrir dès maintenant chez Electro Dépôt et sur electrodepot.fr !'),('962638','Dimensions produit','H 75 cm x L 120 cm x P 64 cm'),('962643','Type de produit','Aiguiseur, affûteur'),('962643','Coloris','Gris'),('962643','Matière','Acier Inox Plastique'),('962643','Compatible lave-vaisselle','N/C'),('962643','Informations complémentaires','Affûte et polit les couteaux en quelques passages.Pour des couteaux aussi tranchants qu’une lame de rasoir en quelques minutes ! Son secret : ses 2 bras à ressort, avec des plaques aiguisantes ultrarésistantes en carbure de tungstène, qui s’écartent en fonction du couteau pour épouser le contour et l’angle de la lame.'),('962643','Dimensions produit','H 9 cm x L 26 cm x P 17 cm'),('962643','Dimensions colis','H 9 cm x L 26 cm x P 17 cm'),('962643','Poids brut','0,44 kg'),('962647','Puissance (W)','1 500 W'),('962647','Matériau base','Plastique'),('962647','Plaques amovibles','Non'),('962647','Nombre de plaques','1'),('962647','Type de plaques','Crêpes'),('962647','Matière de la plaque','Anti-adhésive'),('962647','Diamètre (cm)','11 cm'),('962647','Thermostat réglable','Non'),('962647','Interrupteur marche/arrêt','Non'),('962647','Voyant lumineux de mise sous tension','Non'),('962647','Témoin de chauffe','Non'),('962647','Revêtement anti-adhés