outes vos connexions plus efficaces et plus stables. La technologie d\'antenne avancée augmente la sensibilité de réception pour élargir la couverture Wi-Fi de votre maison.Programmable avec contrôle parental, vous pouvez en plus de cela superviser vos enfants avec un accès responsable, contrôlé par les parents. Utilisez des mots clés pour configurer facilement une liste noire et limiter le niveau d\'accès Web.Configurez l\'Archer A5 en quelques minutes grâce à son interface Web intuitive et à la puissante application Tether. Cette application vous permet également de gérer les paramètres réseau depuis n\'importe quel appareil Android ou iOS, y compris le contrôle parental et le contrôle d\'accès.Accès au réseau invitéPermettez aux invités de rejoindre votre réseau Wi-Fi, tout en protégeant votre vie privée. Facilitez le partage, maintenez la sécurité.Facile à installer et à utiliserConfigurez l\'Archer A5 en quelques minutes grâce à son interface Web intuitive et à la puissante application Tether. Cette application vous permet également de gérer les paramètres réseau depuis n\'importe quel appareil Android ou iOS, y compris le contrôle parental et le contrôle d\'accès.Interface: 4 10/100 Mbps LAN Ports1 10/100 Mbps WAN Port'),('962684','Poids brut','0,69 kg'),('962691','Type d\'enceinte amplifiée','Enceinte amplifiée active'),('962691','Puissance (W)','200 W'),('962691','Jack 6.4 mm','1'),('962691','Bluetooth','Oui'),('962691','RCA','0'),('962691','Entrée auxiliaire','1'),('962691','USB','Oui'),('962691','Prise micro','Oui'),('962691','Sortie Casque','1'),('962691','Lecteur de cartes SD','1'),('962691','Informations complémentaires','SON PUISSANTHaut-parleur performant de 203 mmCONNECTIVITÉ SANS FILJouez la musique sans fil depuis tout appareil BluetoothCONNECTIVITÉ PAR CÂBLEJouez la musique de tout lecteur audio équipé d’une sortie AUX 3.5 mmLECTEUR DE MUSIQUEJouez votre musique préférée contenue sur vos clés USB et cartes microSD3 HEURES DE MUSIQUEBatterie lithiu