2','Réducteur de bruit','Oui'),('963022','Coloris','Blanc'),('963022','Informations complémentaires','La liberté de la technologie sans fil et du contrôle des commandes tactiles.Les Mi True Wireless Earphones utilisent un design  entièrement sans fil, créant une expérience totalement nouvelle. Les commandes tactiles vous permettront de changer de musique, augmenter ou diminuer le son!Changez de mode et partagez comme vous le souhaitezAffranchissez-vous des limites des écouteurs câblés.  Lorsqu\'un appel téléphonique est reçu, il suffit de retirer un écouteur pour passer automatiquement en mode conversation.  Vous pouvez même passer un écouteur à un ami pour bouger ensemble au rythme de la musique.Retirez pour mettre en pauseDes capteurs infrarouges intégrés permettent aux écouteurs de savoir quand vous les portez. Vous pouvez retirer l\'un ou l\'autre des écouteurs pour mettre automatiquement en pause, afin de ne pas manquer une seconde de votre musique ou de ne pas gaspiller l\'énergie de votre batterie.Technologie avancée pour un son optimalAttendez-vous à un son complet, à large spectre et à une fréquence naturellement équilibrée  grâce à l\'aimant néodyme de 7 mm et un haut-parleur à bobine plaqué titane. Activez le mode de réduction du bruit pour une expérience sonore encore plus pure.Un son réaliste avec une  qualité HDLes Mi True Wireless Earphones prennent en charge le codec AAC, ce qui signifie que le son original est complètement restauré et que les voix ne se fondent  pas avec les instruments. Une bonne musique mérite  un son haute définition.'),('963029','Type','Casque sans fil'),('963029','Pliable','Non'),('963029','Plage de fréquence','10 - 20 000 Hz'),('963029','Sensibilité (dB)','100'),('963029','Réducteur de bruit','Non'),('963029','Télécommande','Non'),('963029','Connectiques','FM'),('963029','Coloris','Noir'),('963029','Informations complémentaires','Haut-parleur 32 mm pour un son de grande qualitéÀ la fois compacte et puissante, l\'enceinte 32 mm