t améliorez-le grâce à l’application Mi Fit : Enregistrez vos données de santé et profitez au maximum de votre vie quotidienne.Écran tactile couleur AMOLED, accéléromètre 3 axes et gyroscope 3 axes. Au niveau sportif, bénéficiez d’un entraîneur personnel vous accompagnant à chaque étape !Côté sport : Course à pied : Suit votre rythme et le nombre de pas que vous faites. Faites de l\'exercice en toute sécurité, que vous couriez sur de courtes ou de longues distances.Natation : Étanche jusqu\'à 50 m (5 ATM) ; Reconnaît 5 styles de nage différents ; Enregistre 12 ensembles de données, y compris la vitesse de nage et le nombre de mouvements.Marche rapide : 5 ensembles de données de base. Aide à améliorer l\'efficacité de la marche rapide. Cyclisme : Vérifie votre fréquence cardiaque en temps réel pour vous assurer d\'obtenir la meilleure séance d\'entraînement possible pendant que vous escaladez les routes de montagne ou que vous vous lancez dans la ville.Cordes de combat : Que vous fassiez de l\'entraînement sur corde de combat à haute vitesse ou de l\'entraînement aquatique ou terrestre, Mi Smart Band 4 suivra votre rythme cardiaque, vos calories brûlées et plus encore. Un poids mini (20grammes) pour une efficacité maxi (20 jours d’autonomie selon utilisation) ! Compatible IOS (9.0 ou plus) et Android (4.4 ou plus). Ne permet pas de répondre aux appels ou sms directement.'),('963035','Dimensions colis','H 24 cm x L 7,5 cm x P 17,2 cm'),('963035','Poids brut','0,9 kg'),('963069','Type','Tireuse à bière'),('963069','Capacité (L)','5 L'),('963069','Indicateur changement éléments','non'),('963069','Accessoires','1 poire pour le nettoyage'),('963069','Descriptif complémentaire','Compatibles fûts 5L Beertender (Heineken, Affligem, Desperados, Pelfort...)'),('963069','Informations complémentaires','Découvrir notre Marque et nos Produits Cosylife'),('963069','Poids brut','6,8 kg'),('963069','Dimensions colis','H 44 cm x L 32,4 cm x P 45 cm'),('963069','Dimensions produit','H 