21 m²'),('965558','Capacité du réservoir (L)','1,8 L'),('965558','Débit d\'air (m³/h)','180'),('965558','Niveau Sonore (dB)','48 dB'),('965558','Dimensions produit','H 57 cm x L 38 cm x P 20 cm'),('965558','Dimensions colis','H 59 cm x L 21 cm x P 40 cm'),('965558','Descriptif complémentaire','• PRINTEMPS – Efficace contre le pollen• ETE – Efficace contre les mauvaises odeurs (transpiration, fumées…)• AUTOMNE – Efficace contre les allergies• HIVER – Efficace contre les virus'),('965558','Informations complémentaires','Les purificateurs d’air Sharp sont conçus pour éliminer notamment la poussière, les bactéries, les virus, les pollens, les moisissures et les odeurs en suspension dans l’air, sources d’allergies et d’asthme. Pour assainir l’air, les purificateurs: CAPTENT LA POUSSIÈRE Le pré-filtre lavable capte les grosses particules en suspension dans l’air (poussière, poils, cheveux…) RÉDUISENT LES ODEURS Le filtre à charbon actif/désodorisant absorbe un grand nombre d\'odeurs (fumées, odeurs de cuisine, transpiration, animaux…) RÉDUISENT LE POLLEN ET LES MOISISSURES Le filtre HEPA bloque 99,97% des particules les plus fines (moisissures, pollen, bactéries, acariens…), jusqu\'à 0,3 microns. RAFRAÎCHISSENT Le Plasmacluster traite l’air à peu près de la même façon que la nature se purifie en émettant un mélange équilibré d’ions positifs et négatifs. HUMIDIFIENT Chaque remplissage du réservoir d’eau permet jusqu’à plusieurs heures d’humidification.Des capteurs contrôlent la qualité de l’air en continu pour ajuster automatiquement le fonctionnement du purificateur en fonction de la quantité d’impureté et de l’humidité de l’air détectées.Effets du Plasmacluster: Il empêche la prolifération des moisissures, allergènes, bactéries et virus  Il désactive les mauvaises odeurs (ex: fumée de cigarette) Il réduit l’électricité statiqueLe Plasmacluster a été testé et certifié mondialement par 28 instituts et organisationsDepuis leur lancement en octobre 2000 et jusqu’à fin février 2017, 70 millions de produits équipés de la technologie Plasmacluster ont été vendus dans le monde.'),('965558','Poids net','7,2 kg'),('965558','Poids brut','8,5 kg'),('965575','Fonctions de la chaîne','CD, USB, BLUETOOTH DAB FM'),('965575','Puissance','25W'),('965575','Compatibilité','cd / cd-r / cd-rw / mp3 / usb'),('965575','Tuner radio','DAB+/FM'),('965575','Télécommande','Oui'),('965575','Connectiques','AUXIN, USB, CD'),('965575','Bluetooth','Oui'),('965575','NFC','Non'),('965575','Poids net','4,1 kg'),('965575','Informations complémentaires','Découvrir notre Marque et nos Produits Edenwood'),('965575','Dimensions produit','H 18 cm x L 50 cm x P 12,5 cm'),('965604','Type de produit','Pèse-personne Impédancemètre'),('965604','Affichage','LED CACHE'),('965604','Portée maximale (kg)','150 kg'),('965604','Graduation (g)','50 g'),('965604','Matière','Verre blanc'),('965604','Spécificités','Suivi de la masse de muscle, de graisse corporelle et viscérale, masse osseuse, connecté en bluetooth'),('965604','Fonction','Impédancemètre'),('965604','Impédancemètre','Oui'),('965604','Piles fournies','Non'),('965604','Nombre de piles','4'),('965604','Référence piles','LR03 AAA'),('965604','Nombre de mémoire','16'),('965604','Descriptif complémentaire','Bluethooth, 10 Statistiques et mesure de votre corpsMesures: taille, poids, masse musculaire, métabolisme basal, masse osseuse, IMC, humidité, taux de graisse viscérale, taux de graisse corporelle, indice corporelConnexion Bluetooth 4.0, fonctionne avec les terminaux fonctionnant sous Android 4.4 et iOS 8.0 etsupérieur'),('965604','Dimensions colis','H 6 cm x L 31 cm x P 31 cm'),('965604','Poids brut','2,07 kg'),('965605','Type de chargement','Frontal'),('965605','Capacité lavage (kg)','10 kg'),('965605','Vitesse essorage','1200'),('965605','Classe énergétique','A+++ -10%'),('965605','Type de moteur','A induction'),('965605','Qualité de lavage','A'),('965605','Qualité d\'essorage','B'),('965605','Consommation d\'énergi