ndée : 18 à 31m²* Mode automatique* Mode nuit* Témoin lumineux de qualité de l\'air* Capteur de particules'),('966779','Informations complémentaires','Air pur grâce aux filtres HEPA Élimine 99,97 % des particules de moins de 0,3 micron grâce à ses filtres True HEPA Filtres True HEPA Débit d\'air pur élevé (CADR) : 260m³/h Surveillance en temps réel de l\'IQA Contrôle à distance à l\'aide de l\'application Mi Home LES FILTRES HEPA ASSAINISSENT L\'AIR POUR UNE VIE PLUS SAINEPoursuivant notre tradition de systèmes de pressurisation de l\'air plus efficaces, nous avons équipé notre Mi Air Purifier 2H avec des filtres HEPA, qui sont si efficaces qu\'au moins 99,97% des particules de 0,3 μm ou plus sont filtrées dès le premier passage. L\'air devient si pur qu\'il peut aider à soulager les allergies et les symptômes d\'asthme, ce qui rend les belles journées de printemps un peu plus attrayantes. PRESSION D\'AIR ELEVEE, PLUS GRANDE CIRCULATIONEnvoyez de puissantes rafales d\'air aux confins de votre chambre. Inspiré des moteurs d\'avion, le système de pression aérodynamique créé par notre équipe de recherche et développement tire vers l\'intérieur à partir de la base et expulse l\'air vers le haut avec une grande force. Les commandes intelligentes du téléphone vous permettent de l\'allumer et de l\'éteindre à distance, même lorsque vous êtes loin de chez vous. De cette façon, vous pouvez toujours respirer paisiblement. FILTRES TRUE HEPA AVEC UNE FILTRATION D\'ENTREE D\'AIR DE 360°Des filtres très efficaces sont essentiels pour garder l\'air propre. Nos filtres à air True HEPA avec une entrée d\'air à 360° filtrent l\'air à travers trois couches pour une purification sans effort. La couche primaire filtre les grosses particules ainsi que les cheveux et la poussière. La deuxième couche est un filtre HEPA de grade H13 qui capte les particules de 0,3 μm et plus, y compris les PM2,5, les particules de fumée, les squames animales, le pollen et même les bactéries pathogènes(2). Enfin, la troisième couche est constituée de charbon actif de haute qualité qui absorbe le formaldéhyde et d\'autres produits chimiques nocifs et peut même éliminer les odeurs. Quand il est temps de changer le filtre, l\'application sur votre téléphone vous avertira pour que vous puissiez en commander un nouveau. SURVEILLANCE EN TEMPS REEL DE L\'IQAUtilisez l\'application Mi Home pour contrôler le purificateur d\'air. Vérifiez les changements de la qualité de l\'air ambiant en temps réel, réglez les modes en fonction de la superficie de la pièce, renseignez-vous sur l\'air, y compris les niveaux d\'humidité, activez et désactivez le purificateur, et recevez une notification quand il est temps de remplacer le filtre. Un air plus pur fait partie d\'une vie beaucoup plus intelligente. FAIBLE CONSOMMATION D\'ENERGIEMOINS DE BRUIT, PLUS DE PUISSANCEDormez profondément avec le Mi Purificateur d\'Air 2H ultra-silencieux. L\'aérodynamique avancée réduit le bruit et la résistance au vent pour que vous puissiez profiter du calme et de la tranquillité la nuit. Le moteur japonais personnalisé de Nidec est extrêmement économe en énergie, consommant 58% moins d\'énergie et n\'utilisant que 4,8W en mode Normal.  En mode Nuit, il se peut que vous n\'entendiez pas du tout le purificateur d\'air. Vous pouvez être assuré que votre air est pur pendant que vous vous endormez paisiblement.'),('966779','Poids net','5,2 kg'),('966779','Poids brut','6,6 kg'),('966395','Type de produit','Coque'),('966395','Coloris','Transparent'),('966395','Poids net','0,02 kg'),('966443','Type de produit','Film verre trempé'),('966443','Coloris','Transparent'),('966443','Poids net','0,02 kg'),('966460','Type de produit','Coque'),('966460','Coloris','Transparent'),('966460','Poids net','0,02 kg'),('966496','Type de produit','Coque'),('966496','Compatibilité','Honor 9X'),('966496','Coloris','Transparent'),('966496','Poids net','1 kg'),('966594','Type de produit','Coque'),('966594','Coloris','Multicolore'),('96