 de voitures, l’écran incurvé de Samsung vous plongera complétement dans l’image.Une expérience de jeu fluide et sans ralentissement grâce à la technologie AMD FreeSyncLa technologie AMD FreeSync synchronise le rafraichissement de la carte graphique et de l’écran afin de minimiser les ralentissements et assurer une jouabilité fluide. Le mode jeu optimise les couleurs et le contraste de l’écran pour vous assurer des scènes les plus réalistes.800mm de rayon de courbure et mode Eye Saver pour un meilleur confortUn écran incurvé de 1800 mm pour permettre à vos yeux de parcourir l’écran en conservant la même distance. Les tests cliniques réalisés par le département d’ophtalmologie de l’hôpital universitaire de Séoul ont prouvé que l’utilisation de moniteurs incurvés réduit l’effort visuel en comparaison de l’utilisation de moniteurs classiques. Le mode Eye Saver réduit les émissions de lumière bleue – émissions qui stimulent plus la rétine que les autres couleurs – pour limiter la fatigue visuelle et offre à l’utilisateur une expérience confortable. La technologie Flicker Free Samsung fluidifie l’image pour vous permettre de travailler et jouer plus longtemps dans un meilleur confort.Un design chic et ultra-finUn écran incurvé ultrafin qui vous offre une finesse de 11.9mm seulement – aussi fin qu’un stylo à bille- réduisant l’encombrement de plus de 50% en comparaison avec les anciennes gammes incurvées. L’écran est fixé à un pied circulaire très élégant.'),('967022','Descriptif complémentaire','Mode jeux et AMD FeeSyncsortie casque'),('967022','Dimensions produit','H 46,25 cm x L 62,29 cm x P 24,47 cm'),('967022','Dimensions colis','H 44,1 cm x L 69,7 cm x P 17,7 cm'),('967041','Type','Ventilateur + Chauffage'),('967041','Coloris','Blanc'),('967041','Nombre de vitesses','3'),('967041','Minuterie','Oui'),('967041','Oscillation vent','Oui'),('967041','Puissance (W)','2 600 W'),('967041','Niveau Sonore (dB)','48 dB'),('967041','Télécommande','Oui'),('967041','Informations complémentaires','Air Force associe un chauffage d\'appoint et un ventilateur en un seul appareil puissant, équipé de la technologie Air Circulator 2 en 1 pour un confort optimal quelle que soit la saison. Le plus puissant des appareils de chauffage, un ventilateur silencieux très performant, pour une utilisation pratique tout au long de l\'année.TECHNOLOGIE AIR CIRCULATOR 2EN1La technologie unique brevetée Air Circulator chaude et froide garantit une large circulation de l\'air pour réchauffer ou rafraîchir rapidement votre pièce, pour un confort optimal tout au long de l\'année.L\'APPAREIL DE CHAUFFAGE LE PLUS PUISSANT DE ROWENTAChauffage rapide et plus homogène de la pièce pour réduire la consommation d\'énergie et accroître le confort par rapport à un radiateur classique**.FLUX D\'AIR SILENCIEUX TRES PERFORMANTFlux d\'air silencieux très performant pour un rafraîchissement optimal en dépit de son format compact.COUVRE UNE PIECE ALLANT JUSQU\'A 45m²Rafraîchissement et chauffage intenses pour des pièces allant jusqu\'à 45 m²***.SILENCIEUXLe réglage silencieux garantit un chauffage ou un rafraîchissement très performant sans interruption, à seulement 48 dB(A) sur mode minimal ou 45 dB(A) sur mode ventilateur minimalMODE CHAUFFAGE ECOFonction Eco : maintient la température de la pièce à 19° et permet d\'économiser jusqu’à 50% d’énergie*.MODE CHAUFFAGE ET RAFRAICHISSEMENT AUTOMATIQUELe mode auto ajuste automatiquement les réglages du chauffage ou du ventilateur en fonction de vos besoins, pour un niveau de confort optimal tout au long de l\'année.CONFORT D\'UTILISATION MAXIMALLe minuteur (en mode ventilateur et chauffage) et la fonction de départ différé (en mode chauffage uniquement) permettent une utilisation intuitive et pratique.PRATICITELa télécommande et son support intégré offrent un contrôle pratique de toutes les fonctions à distance.SECURITE RENFORCEEArrêt automatique en cas de basculement pour plus de sécurité et pour une liberté d\'esprit totale.FACILEMEN