r le rétroéclairage RGB selon de très nombreux effets ainsi que d’assigner des macros pour réaliser actions complexes plus rapidement que vos adversaires. Sa forme ergonomique conviendra à toutes les tailles de mains et vous assure une confort absolu.Précision MaximaleFaites la différence face à vos adversaires grâce à la souris gaming Kult Radium ! Dotée d’un capteur optique de dernière génération, la Kult Radium vous procure une précision extrême. Avec elle, vous ne manquerez jamais votre cible. Vous pourrez ajuster la sensibilité de la souris de 200 à 4800 DPI via 6 paliers différents selon vos préférences. Changez de sensibilité en un instantgrâce au bouton DPI de la souris. Le taux de rafraîchissement de 125 Hzvous permet de profiter d’une réactivité maximale dans les situations les plus intenses. Avec une accélération max de 15G, cette souris gaming vous assure un parfait suivi de vos mouvements, même les plus rapides !Rétroéclairage RGB personnalisableTrès facile à régler grâce à notre logiciel de personnalisation, vous pourrez choisir parmi 10 effets lumineux variés et dynamiques. Vous pourrez également associer une couleur pour chaque niveau de DPI et ainsi toujours connaître votre sensibilité une fois en jeu. A vous de choisir les couleurs,l’intensité lumineuse et la vitesse des effets pour créer la souris de vos rêves !Design Ergonomiquela Kult Radium a été conçue pour garantir un confort absolu une fois en main. Sa forme vous permet d’accéder à tous les boutons sans difficulté, La Kult Radium ne pèse que 115g seulement, elle est ultra légère pour vous permettre de faire des mouvements plus rapidement ! Elle dispose de 5 patins pour garantir une glisse optimale de la souris, peu importe la surface sur laquelle vous jouez.100% ProgrammableGrâce à notre logiciel de personnalisation vous pouvez programmer chacun des 7 boutons avec des macros pour ainsi réaliser des actions complexes en un temps record et surpasser vos adversaires. Il y a 3 profils différents ce qui vouspermettra d’adapter vos macros selon les jeux sans avoir à les refaire. La fonction Sniper diminue votre sensibilité en mode visée dans les FPS pour être plus précis par exemple. Le logiciel de la Kult Radium vous permet également de gérer les effets de rétroéclairage Compatibilité Multi-PlateformesTrès facile à utiliser, il vous suffit de brancher la souris gaming Kult Radium et elle fonctionnera instantanément. La Kult Radium se branche en USB et est compatible sur PC, PS4, Xbox One et Mac. Assurez vous cependant que le jeu sur console permet de jouer avec une souris à la place d’une manette.Réactivité immédiate :Polling Rate 500 Hz'),('967363','Dimensions produit','H 12,7 cm x L 6,9 cm x P 3,5 cm'),('967363','Dimensions colis','H 19 cm x L 11 cm x P 6 cm'),('967363','Poids brut','0,19 kg'),('967365','Utilisation','Bureautique et TV'),('967365','Type','Clavier Bluetooth 3.0'),('967365','Casque vibrant','0'),('967365','Coloris','Noir'),('967365','Informations complémentaires','Découvrez le nouveau type de clavier universel Multi-device, compatible avec votre tablette, smartphone et ordinateur.Passez facilement d’un dispositif à un autre pour choisir entre vos deux appareils connectés.Bénéficiez d’un confort de frappe et d’un design pratique et fin, pour tous vos déplacements.Avec son support intégré, maintenez facilement votre téléphone ou tablette dans un angle parfait.Alimentation : Batterie lithium intégréeCompatibilité : ANDROID, iOS, Windows, OS XConnectivité : BluetoothCouleur : Argenté et noirHauteur (cm) : 1,6Largeur (cm) : 15,4Longueur (cm) : 28,5Nombre de touches : 78Technologie : Bluetooth 3.0'),('967365','Dimensions produit','H 1,6 cm x L 28,5 cm x P 15,4 cm'),('967365','Dimensions colis','H 2,5 cm x L 32,5 cm x P 17,5 cm'),('967365','Poids brut','0,458 kg'),('967367','Type de produit','Bouilloire'),('967367','Coloris','Noir et inox'),('967367','Capacité (L)','1,8 L'),('967367','Puissance (W)','2 200 W'),('967367','Socle connecteur 360°','Ou