jusqu\'à 85 MB/spermet un transfert très rapide de vos contenusNouvelle classe vidéo V30 qui permetd’identifier simplement un appareil compatibleParfaites pour la prise de photos en rafale ou lacapture vidéos en qualité Full HD, 3D ou 4K Pourquoi une carte SD / MSD 4K ?Quels sont les usages ? Pour la GoPro :Pour atteindre de manière constante les meilleurs résultats avec une caméraGoPro, la classe minimum de vitesse requise est la Classe 10 UHS-I U1(vitesse d’écriture : 10MB/S).La meilleure vitesse pour une GoPro est atteinte avec une carte UHS-I U3adaptée au 4K (vitesse d’écriture : 30MB/s).Les cartes SpeedIN sont donc une excellente solution pour les GoProPour les appareils photos reflex :Pour les photos prises en mode rafale avec un appareil photo reflex, tellesque les scènes de sport ou d’action, les cartes Speed’In sont recommandées.Une vitesse d’écriture de 85MB/s permet de sauvegarder son contenu sansattentePour les consoles de jeux :Les cartes SpeedIN sont idéales pour être utilisées avec les consoles Nintendo (Wii U, Wii, 3DS).Ces consoles de jeux requièrent des appareils de stockage avec de hautesperformances pour sauvegarder et lire les fichiers des jeux vidéos. 4. Pour les box TVPlusieurs box TV disponibles sur le marché européen proposent désormaisune définition 4K.Par exemple, Free a lancé sa “Freebox mini 4K” avec un port pour unecarte SD qui permet de lire tout son contenu multimedia en 4K et de lediffuser sur grand écranPour les drones: Pour la plupart des drones il est recommandé d’utiliser au minimum unecarte de Classe 10 UHS-I U1, cependant lorsque le drone est équipé d’unecaméra 1080p ou 4K comme sur le DJI Phantom, il est recommandéd’utiliser une carte SpeedIN qui permetra d’assurer de longsenregistrements en qualité maximale, et de manière fiable'),('967460','Dimensions colis','H 13,5 cm x L 9,6 cm x P 0,75 cm'),('967460','Poids brut','0,013 kg'),('967515','Format','3.5'),('967515','Type','Disque dur mécanique'),('967515','Capacité (Go)','2 00