ffer vos cheveux de manière très précise, ou apporter plus de résistance et de volume. Le résultat : de belles boucles brillantes parfaitement coiffées ! Sèche-cheveux ionique, Parfait pour tout type de cheveux, Commande tactile , Protection contre la surchauffe (AOPP) & systèmes de Chaleur équilibrée (EHD), Ventilation à froid, Verrouillage de la température Inclus un concentrateur et un diffuseur, Cordon (1,8 m) avec suspension pratique , Filtre démontableLe Silk’n Gosleek IR est le lisseur idéal pour réparer et améliorer la brillance de vos cheveux.Cet appareil est un lisseur conçu pour tout type de cheveux. Avec ses plaques larges et son revêtement céramique, lisser vos cheveux n’aura jamais été aussi rapide et sûr. Profitez d’une coiffure parfaitement lisse où que soyez grâce à sa pochette ultra pratique.Silk’n Gosleek IR utilise une technologie de pointe :la technologie infrarouge, qui assure à vos cheveux une meilleure pénétration de la chaleur dans la fibre capillaire. Ses 5 niveaux de températures (de 130° à 200°) vous laissent la possibilité de choisir la température qui convient le mieux à vos cheveux. Vous retrouverez ces indications sur l’écran LED. Vous gagnerez du temps puisqu’en 30 secondes vous atteindrez le niveau de température 130°C. Grâce au système de chauffe PTC vous garantirez à vos cheveux une protection supplémentaire avec le contrôle de la chaleur.'),('967572','Dimensions produit','H 30,6 cm x L 34,5 cm x P 17,5 cm'),('967572','Dimensions colis','H 30,6 cm x L 34,5 cm x P 17,5 cm'),('967572','Poids brut','1,8 kg'),('967573','Type de clé','Clé 2 ports USB / USB-C'),('967573','Capacité de stockage (Go)','32 Go'),('967573','Informations complémentaires','Les Principales caractéristiques de la Clé USB 3.0 Type C MAX’L - -La Clé Dual USB 3.0 Max’L intègre sur la même Clé USB une Connexion USB 3.0 et une connexion Type C - Permet de partager facilement des Photos, des Documents, de la Musique avec votre ordinateur , votre tablette ou même votre 