 de haut volInterface utilisateur ASUSWRT pour une installation et une gestion rapides de votre routeurMeilleure couverture réseau et performances multi-appareils avec quatre antennes externes deux pour chaque bande de fréquence (2,4 GHz et 5 GHZ)Contrôles parentaux avancés protégeant vos enfants contre l’addiction à internet. Vous pouvez restreindre leur d’utilisation en définissant un couvre-feuASUS Router App facilite l’usage de votre connexion Wi-FiFonctionnalité permettant de connecter deux ports WAN simultanément en évitant l’interruption du réseau causée par l’ISPASUSWRT, pour un contrôle et une optimisation facilitésApplication ASUS RouterContrôlez votre réseau de partoutDans notre mode de vie de plus en plus mobile, la possibilité de contrôler son réseau grâce à une application est plus que jamais un atout. La nouvelle application ASUS Router App est entièrement conçue pour être à la fois intuitive et fiable. Vous pouvez ainsi paramétrer votre routeur, gérer le trafic sur le réseau, réaliser des diagnostics de vos problèmes de connexion et même mettre à jour le firmware, sans avoir à allumer d\'ordinateur. Wi-Fi AC ultra-rapide avec l\'accélération Wi-Fi 256QAM™Compatible avec le Wi-Fi 5e génération (Wi-Fi 5G), le chipset 802.11ac offre au RT-AC1200 V2 un meilleur débit qu\'avec n\'importe quel routeur standard. Avec sa bande passante de 2,4 GHz, il atteint un débit de 300 Mo/s et de 867 Mo/s sur la bande à 5 GHz. Avec cette bande passante améliorée, profitez des joies du Wi-Fi, chez vous. Les ordinateurs portables, les PC de bureau, les tablettes et les smartphones étant tous compatibles avec le Wi-Fi, il est temps de passer à la nouvelle génération de Wi-Fi.Connexion à double bande pour des loisirs fluidesAvec ses deux bandes de fréquence de 2,4 GHz et 5 GHz, offrant respectivement un débit de 300 Mo/s et 867 Mo/s, disposez d\'une bande passante totale stable allant jusqu\'à 1167 Mo/s. Vous pourrez naviguer sur Internet et télécharger des fichiers sur la bande de 2,4 GHz tout en streamant du contenu en 3D HD et en exécutant d\'autres tâches gourmandes sur la bande 5 GHz.Configuration en 3 étapesUtilisez votre smartphone, votre tablette ou votre PC pour paramétrer aisément votre routeur ASUS en moins de 30 secondes¹ et en trois étapes seulement. Connectez vos câbles au routeur, ouvrez un navigateur et suivez les étapes pour accéder à Internet en un rien de temps. Débit de données802.11a : 6, 9, 12, 18, 24, 36, 48, 54 Mb/s802.11b : 1, 2, 5.5, 11 Mb/s802.11g : 6, 9, 12, 18, 24, 36, 48, 54 Mb/s802.11n : jusqu\'à 300 Mb/s802.11ac : jusqu\'à 867 Mb/sMémoire16 MB Flash64 MB RAMCryptage64-bit WEP, 128-bit WEP, WPA2-PSK, WPA-PSK, WPA-Enterprise , WPA2-Enterprise , Support WPS Ports1 x RJ45 pour 10/100 BaseT pour WAN, 4 x RJ45 pour 10/100 BaseT pour LANFonctionnalitésRouter appTraditional QoSRéseau invité: 2.4 GHz x 3, 5 GHz x 3Double WANSupport IPTVBeamforming'),('967606','Poids brut','1,05 kg'),('967607','Usage','Partager le wifi partout'),('967607','Débit maximal théorique (Mbps)','150'),('967607','Normes Wifi supportées','2/3/4G'),('967607','Fréquence(s)','2,4 GHz, 5 GHz'),('967607','Dimensions produit','H 6,6 cm x L 10,6 cm x P 1,6 cm'),('967607','Dimensions colis','H 13,5 cm x L 9,5 cm x P 5 cm'),('967607','Informations complémentaires','2 en 1 : modem LTE + routeur WiFiCompatible réseau 4G LTE* via carte SIM** jusqu\'à 150 Mbps en téléchargement et 50 Mbps en uploadSlot pour carte SIM** tout opérateurSupporte jusqu\'à 10 appareils simultanémentWiFi sélectionnable en 2.4 GHz (débit jusqu\'à 150 Mbps) ou en 5 GHz (jusqu\'à 433 Mbps)Puissante batterie de 2000 mAh idéale pour plus 8 heures d\'utilisation extérieurePort Micro USB pour une recharge facile de la batterieAffichage OLED 1.4 couleur fournissant un état intuitif du produitEquipé d\'un emplacement pour cartes Micro SD offrant en option jusqu\'à 32 Go de stockage.Couverture 4G : fonctionne en Europe, Moyen-Orient, Afrique ainsi que dans la plupart des pays asiatiques. Veuillez vérifier la bande de fréquence mobile de l\'opérateur local avant utilisation.4G LTE - Surfez à la vitesse de la lumièreSupportant jusqu\'à 150 Mbps en téléchargement et 50 Mbps en téléversement, le TP-Link M7350 est à la pointe du partage de connexion 4G LTE, combinant la mobilité d\'une connexion sans fil 4G. Le M7350 vous permet de surfer à des vitesses incroyables, de télécharger rapidement et de visualiser du contenu HDPartage du WiFi bi-bande jusqu\'à 10 appareilsLe M7350 est capable de partager un signal 4G WiFi à près de 10 utilisateurs simultanément - ordinateurs portables, tablettes, smartphones, etc., proposant ainsi une expérience de navigation Internet fluide, depuis presque n\'importe où.Autonomie remarquable- 8h de partage 4GAvec une puissante batterie de 2000mAh, le M7350 est capable de fonctionner 8 heures* à pleine charge et d\'être rechargé via un câble micro USB depuis un ordinateur portable, un adaptateur secteur ou via le transformateur fourni et ce pour des heures de partage 4G.* ces valeurs peuvent différées selon l\'environnement d\'utilisationD\'un coup d\'oeil vous trouvez l\'information sur l\'affichage OLEDAvec un boitier compact, incluant un écran OLED, le M7350 offre une vue interactive de son état de fonctionnement, avec une jauge de batterie, une information sur le réseau (2G/3G/4G), la force du signal et le status du WiFiAdministration facile avec l\'App tpMiFi Avec l\'App tpMiFi, vous pouvez facilement accéder et gérer votre M7350 à partir d\'un appareil iOS connecté. L\'application tpMiFi vous permet d\'établir des limites de données, le contrôle des appareils qui peuvent accéder à votre réseau WiFi, envoyer des messages et partager des fichiers multimédias vers / à partir d\'une carte Micro SD amovible.Stockage sur Micro SDLe M7350 est pourvu d\'un emplacement pour cartes micro SD qui accepte des cartes SD de 32 Go au plus, ce qui permet aux utilisateurs d\'utliiser cette capacité de stockage externe comme une clé US