2,6 kg'),('967638','Type d\'épilateur','Epilateur rechargeable étanche + brosse visage'),('967638','Nombre de pincettes','40 pincettes qui permettent de retirer les poils des 0,5 mm'),('967638','Type de tête','tête pivotante sensosmart'),('967638','Système anti-douleur','Le gant rafraîchissant refroidit efficacement la peau avant et la calme après l’épilation pour augmenter encore plus votre confort.'),('967638','Zone d\'application','Visage, jambes et zones sensibles'),('967638','Utilisable sous l\'eau','Oui'),('967638','Alimentation','Rechargeable'),('967638','Autonomie','Rechargement complet en 1 heure pour une autonomie de 50 minutes.'),('967638','Informations complémentaires','BEAUTY SETLe coffret le plus luxueux de Braun, pour une peau lisse sur toutes les parties du corps. Pour une utilisation sur le visage, les jambes et les zones sensibles. Suivez notre routine beauté pour obtenir une peau impeccable : exfolier, épiler, raser, nettoyer.EPILATEUR SILK-EPILSensoSmart™Un capteur intelligent innovant guide votre épilation : il s’assure qu’une pression adéquate est appliquée sur la peau afin de permettre de retirer encore plus de poils à chaque passage.Technologie de pincettes MicroGripDoté de pincettes plus larges, plus longues et plus profondes, l’épilateur Silk-épil 9 de Braun élimine avec précision les poils les plus courts que la cire ne peut attraper (jusqu’à 0,5 mm). Vous n’aurez donc pas besoin d’attendre que vos poils soient suffisamment longs pour permettre une épilation à la cire. Finis les jours intermédiaires, oubliés les tracas.Tête pivotanteS’adapte en douceur aux courbes de votre corps pour plus d’efficacité et de confort.Tête extra-largeL’épilateur Silk-épil 9 de Braun dispose d’une tête 40 % plus large¹ qui élimine beaucoup plus de poils en un seul passage, pour une épilation plus rapide. Il met la barre plus haut que jamais en matière d’épilation, avec une peau douce jusqu’à 4 semaines.¹Par rapport aux autres épilateurs BraunSystème de massage haute fréquenceAvec pulsations vibrantes actives - pour une épilation extra-douce.Technologie Wet & DryFonctionne dans le bain et sous la douche pour une épilation plus confortable.BRAUN FACESPA10 micro-ouverturesCapture les poils les plus fins à partir de 0,02 mm d’épaisseur, et seulement 0,5 mm de longueur !Plus rapide que les méthodes ordinaires (par ex. pince à épiler manuelle)Avec 200 mouvements par seconde.Brosse nettoyante visageOscille délicatement pour retirer le maquillage, le sébum et les impuretés, jusqu’à 6 fois plus efficace qu’un nettoyage manuel.Parfait pourle menton, la lèvre supérieure, le front et pour entretenir vos sourcils.'),('967638','Dimensions produit','H 19,9 cm x L 26,2 cm x P 9,3 cm'),('967638','Dimensions colis','H 19,9 cm x L 26,2 cm x P 9,3 cm'),('967638','Poids net','1 kg'),('967638','Disponibilité pièces détachées (données fournisseur)','5 ans date d\'achat'),('967639','Utilisation','Bureautique'),('967639','Sans fil','Oui'),('967639','Bluetooth','Non'),('967639','Sensibilité minimale souris','1 000 dpi'),('967639','Sensibilité maximale souris','1 000 dpi'),('967639','Nombre de boutons souris','3'),('967639','Piles incluses ou non','2 AAA - LR03 incluses'),('967639','Coloris','Beige'),('967639','Dimensions produit','H 21,5 cm x L 24 cm x P 4 cm'),('967639','Dimensions colis','H 21,5 cm x L 24 cm x P 4 cm'),('967639','Poids brut','0,236 kg'),('967658','Résolution de l\'écran','1280 x 800 HD'),('967658','Technologie écran','IPS'),('967658','Taille écran en pouces','10,1'),('967658','Taille écran en cm','25,65 cm'),('967658','Type de processeur','ARM Cortex -A7 QUAD CORE'),('967658','Puissance du processeur (Ghz)','1,3 GHz'),('967658','Mémoire vive (RAM) (Go)','2'),('967658','Mémoire interne (Go)','64'),('967658','Autonomie','NC'),('967658','Capacité batterie','5000 mAh'),('967658','Connectiques','Jack 3.5 mm, Micro USB, Micro-SD'),('967658','Connexions','3G, Bluetooth, Wi-Fi'),('967658','Extension de mémoire','extensible via port mic