ITÉ SUPÉRIEUREQuatre capteurs équipent le dos du Realme 6i pour vous permettre de prendre des photos de haute qualité. Le capteur principal de 48 mégapixels est accompagné d\'un capteur secondaire de 8 mégapixels offrant un ultra grand-angle 119°.Quant à l\'appareil photo avant de 16 mégapixels, faites le selfie parfait grâce à des couleurs lumineuses et des détails à couper le souffle. De plus, profitez de la lumière naturelle au maximum avec l\'optimisation en faible luminosité ainsi que sa large ouverture f/2.0.'),('967911','Accessoires','Câble USB, adaptateur secteur, kit piéton'),('967911','Dimensions produit','H 16,4 cm x L 7,54 cm x P 0,9 cm'),('967911','Dimensions colis','H 7,55 cm x L 8,73 cm x P 17,6 cm'),('967911','Poids','199g'),('967911','Poids brut','0,383 kg'),('967911','Catégorie mobile','Neuf'),('967911','DAS Tête (W/kg)','0,783'),('967911','DAS tronc (W/kg)','1,095'),('967911','DAS Membres (W/kg)','2,065'),('967911','DAS texte réglementaire','Le débit d\'absorption spécifique (DAS) local quantifie l\'exposition de l\'utilisateur aux ondes électromagnétiques à puissance maximale de l\'équipement concerné. Le DAS maximal autorisé est de 2 W/kg pour la tête et le tronc et de 4 W/kg pour les membres'),('967903','Type d\'appareil','LISSEUR VAPEUR PROFESSIONEL'),('967903','Largeur des plaques','4,5 cm'),('967903','Revêtement des plaques','Céramique'),('967903','Réglage de la température','Oui'),('967903','Prêt en','15s'),('967903','Température minimale (°C)','180°C'),('967903','Température maximale (°C)','210°C'),('967903','Informations complémentaires','Le lisseur vapeur révolutionnaire de la marque L\'Oréal Professionnel se renouvelle pour donner naissance au tout nouveau Steampod 3.0.  Toujours aussi efficace sur tous les types de cheveux mêmes les plus épais ou crépus, il gagne en polyvalence, grâce notamment, à son nouveau design qui lui permet aussi bien de lisser que de boucler.L\'autre changement majeur face à son aîné le Steampod 2.0, est l\'int