ique'),('968014','Résistance','Eau et poussière'),('968014','Coloris','Gris'),('968014','Descriptif complémentaire','Premier à fusionner stylo et smartphone, le Note place un tout nouvel univers entre vos mains. Ceci n’est pas un smartphone comme les autres. C’est un véritable ordinateur dans votre poche. C’est le gaming nouvelle génération sur mobile. C’est une caméra 8K et une suite de montage de qualité professionnelle.C’est un smartphone ultra puissant qui va changer à jamais votre façon de travailler et de vous divertir.° Passez des griffonnages disparates à une écriture claire d’une simple pression, d’une pression du S Pen, votre écriture se rectifie d’elle-même si vous écrivez en biais, pour garder vos notes lisibles et organisées. Il est même possible de transformer vos notes en texte que vous pourrez copier et coller. Vous pouvez ensuite exporter vos notes sous forme de fichier PowerPoint ou Word pour les partager facilement.° Contrôlez votre smartphone depuis votre PCConnectez votre smartphone à votre PC, facilement et sans fil. Vous pouvez alors ouvrir des applications de votre smartphone directement sur votre ordinateur. Profitez du meilleur de vos réseaux sociaux, gardez le contact avec vos amis, ou commandez un repas, le tout directement sur votre écran d’ordinateur.° Une charge complète le matin vous accompagne jusqu\'au bout de la nuit Les Galaxy Note20 et Note20 Ultra sont équipés d’une batterie intelligente de 4300 mAh et 4500 mAh qui utilisent leur puissance de manière efficace, afin que vous puissiez travailler toute la journée et vous divertir jusqu’à tard le soir. Résultat : non seulement vous avez un bijou technologique entre vos mains, mais vous avez aussi suffisamment de batterie pour l’utiliser.'),('968014','Accessoires','Câble USB, adaptateur secteur, kit piéton'),('968014','Dimensions produit','H 16,16 cm x L 7,52 cm x P 0,83 cm'),('968014','Dimensions colis','H 6,17 cm x L 8,78 cm x P 16,8 cm'),('968014','Poids','198g'),('968014','Poids 