','Hauteur de coupe minimale (cm)','0,5 mm'),('968217','Hauteur de coupe maximale (cm)','23 mm'),('968217','Verrouillage de la hauteur de coupe','Oui'),('968217','Nombre de sabots','1'),('968217','Affichage','Non'),('968217','Nettoyage','Tête amovible et lavable'),('968217','Accessoires','1 peigne de guidage, Brossette de nettoyage'),('968217','Informations complémentaires','Technologie Trim-n-Flow pour une coupe ininterrompue :Notre nouveau sabot innovant est conçu pour éviter que les cheveux ne restent bloqués dans la tondeuse. Vous pourrez donc poursuivre votre tâche, du début à la fin, sans interruptions.Lames doublement affûtées pour une coupe 2 fois plus rapide :Coupez tous types de cheveux, grâce à notre technologie avancée DualCut : un élément de coupe innovant à deux tranchants coupe les cheveux deux fois plus rapidement que des lames à un tranchant.Lames en acier inoxydable auto-affûtées:Les lames en acier inoxydable auto-affûtées offrent une incroyable durée de vie. Même au bout de 5 ans, elles coupent comme au premier jour.13 hauteurs de coupe faciles à sélectionner et à verrouiller : de 0,5 à 23 mm :Il vous suffit de sélectionner et de verrouiller la hauteur de coupe de votre choix. Le sabot réglable offre 12 hauteurs de coupe verrouillables comprises entre 1 et 23 mm, séparées par un pas d\'exactement 2 mm. Retirez le sabot pour une coupe à 0,5 mm.Système d\'alimentation efficace sur secteur:Le cordon d\'alimentation de 1,8 m permet une alimentation ininterrompue.Manche ergonomique pour plus de confort et de maîtrise:La TONDEUSE À CHEVEUX Series 3000 est conçue pour être agréable à utiliser, pratique à manipuler et facile à utiliser. Sa texture spéciale et son manche vous permettent de déplacer facilement la tondeuse sur toute la surface de votre tête.Lames faciles à détacher et à nettoyer:Déclipsez simplement la tête amovible pour détacher les lames et les nettoyer.Aucun entretien, aucune lubrification nécessaire:Aucune lubrification nécessaire, pour 