ede 8G.Conçue pour le jeu Avec sa prise en main parfaite pour tous, son revêtement en soft touch, la Kult Néon a été dessinée pour un usageprolongé enjeu !Rechargeable !Fini les piles vides au milieu d\'une partie, la batterie de la Kult Néon est rechargeable. Jouez jusqu\'à 15 heures sans soucis ! En désactivant son rétroéclairage, son autonomie peut même atteindre les 100 heures ! Continuez à jouer alors qu\'elle se recharge grâce au mode filaire !'),('968364','Dimensions produit','H 7 cm x L 12,5 cm x P 4 cm'),('968364','Dimensions colis','H 19 cm x L 11 cm x P 6 cm'),('968364','Poids brut','0,19 kg'),('968193','Type de produit','extracteur de jus'),('968193','Puissance (W)','200 W'),('968193','Nombre de vitesses','2'),('968193','Cheminée extra large','Non'),('968193','Capacité (L)','0,8 L'),('968193','Niveau de jus visible','Oui'),('968193','Réservoir amovible','Oui'),('968193','Compatible lave-vaisselle','Oui'),('968193','Dimensions produit','H 42 cm x L 18,5 cm x P 34 cm'),('968193','Dimensions colis','H 33,1 cm x L 30,2 cm x P 35,8 cm'),('968193','Descriptif complémentaire','Jusqu\'à 2 fois plus de jus qu\'une centrifugeuse.filtre à jus et à coulis en inox, stop goutte et brossette de nettoyage.'),('968193','Poids net','4,4 kg'),('968193','Poids brut','6,6 kg'),('968393','Type de produit','Draisienne électrique pour enfant'),('968393','Vitesse max','15 km/h'),('968393','Charge max','50 kg'),('968393','Autonomie','8 km'),('968393','Temps de charge','3 h'),('968393','Type de batterie','24V'),('968393','Poids appareil','8 kg'),('968393','Accessoires fournis','Aucun'),('968393','Taille des roues','12 (30,48 cm)'),('968393','Dimensions produit','H 48 cm x L 70 cm x P 35 cm'),('968393','Dimensions colis','H 53 cm x L 97 cm x P 23 cm'),('968393','Mentions sécurité','GARDEZ VOTRE ENFANT SOUS SURVEILLANCE, Port du casque et protections conseillés.'),('968393','Coloris','Noir'),('968393','Poids brut','10 kg'),('968393','Disponibilité pièces détachées (données fournisse