nnexion Bluetooth 4.0, fonctionne avec les terminaux fonctionnant sous Android 4.4 et iOS 8.0 et supérieurBracelet connecté Mi Band 4 : A la recherche d’un compagnon digital performant ? Le bracelet connecté Xiaomi Mi BAND 4 est fait pour vous ! Léger, élégant et discret, il est un parfait compagnon vous suivant dans toutes les étapes de votre journée : Au sport, au travail et durant votre sommeil, suivez et visualisez une grande quantité de données. Sur terre comme en mer, votre bracelet ne vous quittera plus, étanche jusqu’à 50 mètres de profondeur.Vous pourrez de contrôler votre activité cardiaque et la qualité de votre sommeil, ainsi que le nombre de pas réalisés dans la journée pour garder une santé optimale !Ne manquez rien, soyez informé en temps réel grâce à 48 caractères de notification, ne loupez plus vos dernières notifications Facebook, WhatsApp ou encore les appels de votre téléphone en silencieux. Doté d’une alarme bracelet, Une légère vibration vous aidera à vous réveiller pour commencer la journée de la meilleure façon possible.De plus, suivez-votre rythme de vie et améliorez-le grâce à l’application Mi Fit : Enregistrez vos données de santé et profitez au maximum de votre vie quotidienne.Écran tactile couleur AMOLED, accéléromètre 3 axes et gyroscope 3 axes.Au niveau sportif, bénéficiez d’un entraîneur personnel vous accompagnant à chaque étape !Côté sport :Course à pied : Suit votre rythme et le nombre de pas que vous faites. Faites de l\'exercice en toute sécurité, que vous couriez sur de courtes ou de longues distances.Natation : Étanche jusqu\'à 50 m (5 ATM) ; Reconnaît 5 styles de nage différents ; Enregistre 12 ensembles de données, y compris la vitesse de nage et le nombre de mouvements.Marche rapide : 5 ensembles de données de base. Aide à améliorer l\'efficacité de la marche rapide.Cyclisme : Vérifie votre fréquence cardiaque en temps réel pour vous assurer d\'obtenir la meilleure séance d\'entraînement possible pendant que vous escaladez les routes de montagne ou que vous vous lancez dans la ville.Cordes de combat : Que vous fassiez de l\'entraînement sur corde de combat à haute vitesse ou de l\'entraînement aquatique ou terrestre, Mi Smart Band 4 suivra votre rythme cardiaque, vos calories brûlées et plus encore.Un poids mini (20grammes) pour une efficacité maxi (20 jours d’autonomie selon utilisation) ! Compatible IOS (9.0 ou plus) et Android (4.4 ou plus). Ne permet pas de répondre aux appels ou sms directement.'),('968622','Dimensions colis','H 4,7 cm x L 32,3 cm x P 38,3 cm'),('968622','Poids brut','1,9 kg'),('968625','Type cafetière','Cafetière'),('968625','Coloris','Noir et gris'),('968625','Puissance (W)','1 000 W'),('968625','Programmable','Non'),('968625','Capacité du réservoir (L)','1,25 L'),('968625','Isotherme','Non'),('968625','Nombre de tasses max','10-12 tasses'),('968625','Maintient au chaud','Oui'),('968625','Porte filtre','Amovible'),('968625','Niveau d\'eau visible','Oui, avec graduation'),('968625','Système anti-gouttes','Oui'),('968625','Type de verseuse','Verseuse Verre'),('968625','Veille automatique','Oui'),('968625','Descriptif complémentaire','Auto off = coupure automatique après 30 min'),('968625','Dimensions produit','H 32,5 cm x L 22 cm x P 23,3 cm'),('968625','Dimensions colis','H 34,5 cm x L 22,2 cm x P 25,6 cm'),('968625','Poids net','1,5 kg'),('968625','Poids brut','2,45 kg'),('968634','Puissance enceintes (W)','5 W'),('968634','Gamme d\'ondes','FM/DAB/DAB+'),('968634','Alimentation','Secteur'),('968634','Connectiques','ENTREE AUX IN , SORTIE CASQUE, USB'),('968634','Prise casque','Oui'),('968634','Alarme','N/C'),('968634','Lecteur CD/CD-R','CD, MP3'),('968634','Coloris','Blanc'),('968634','Poids net','1,19 kg'),('968634','Poids brut','1,815 kg'),('968634','Dimensions colis','H 27,4 cm x L 21,8 cm x P 29,2 cm'),('968634','Dimensions produit','H 12 cm x L 29 cm x P 27,4 cm'),('968635','Fonctions de la chaîne','Lecteur CD'),('968635','Puissance','50 W'),('968635','Comp