eur de vitesse sophistiqué et système de récupération d\'énergie cinétique (KERS) Le KERS récupère l\'énergie cinétique d\'un véhicule en mouvement lors d\'un freinage longue durée. Le système de régulation de la vitesse aide à maintenir une vitesse constante fixée par le conducteur afin d’éviter les à-coups liés aux accélérations.Les batteries de haute qualité garantissent une autonomie allant jusqu\'à 30 km Quarante cellules li-ion de 18650 offrent une capacité totale élevée de 275Wh. Système de gestion intelligente des batteries (BMS).  Double système de freinage Équipé d\'un système de freinage régénératif et à disque à la roue arrière, d\'un système E-ABS à la roue avant.Pneus antidérapants et amortisseurs Les pneus de 8,5 pouces absorbent efficacement les chocs et empêchent le glissement. Le moteur à courant continu sans balais de 250 W permet au scooter de rouler avec facilité et confort.  Se connecte à l\'application Mi Home Vérifiez la vitesse de conduite et la batterie  restante en temps réel après avoir jumelé votre scooter par Bluetooth avec votre téléphone.'),('968686','Poids brut','17 kg'),('968705','Type','Jeu NINTENDO Switch'),('968705','Dimensions colis','H 15 cm x L 17,5 cm x P 11 cm'),('968705','Poids brut','0,054 kg'),('968706','Type','jeu PS4'),('968706','Dimensions colis','H 15 cm x L 17,5 cm x P 11 cm'),('968706','Poids brut','0,54 kg'),('968717','Classe énergétique','A+'),('968717','Taille écran en cm','81 cm'),('968717','Taille écran en pouces','32'),('968717','Technologie TV','LED HD'),('968717','Bluetooth','Non'),('968717','HDR','Non'),('968717','Wifi','Non'),('968717','Résolution','1366 x 768p'),('968717','Tuner','TNT HD MPEG 4 - DVBT2'),('968717','Contraste','1 000 000 : 1'),('968717','Fonctions USB','Lecteur audio photo vidéo'),('968717','HDMI','3'),('968717','Péritel','1'),('968717','Optique','1'),('968717','Prise casque','Oui'),('968717','Mise en veille programmable','Oui'),('968717','Restitution sonore','2 x 10w'),('968717','Accessoi