aques flottantes et longues de 110 mm appliquent une pression uniforme sur toute la chevelure sans accrocher et pour des résultats professionnels. De plus, sa mise à température rapide est pratique pour être prêt rapidement. Le lisseur Aqualisse est l\'outil qu\'il vous faut pour créer de sublimes lissages qui durent...en un rien de temps !'),('968813','Dimensions produit','H 15,6 cm x L 35,6 cm x P 6,5 cm'),('968813','Dimensions colis','H 15,6 cm x L 35,6 cm x P 6,5 cm'),('968813','Poids brut','3,85 kg'),('968806','Type d\'épilateur','Rasoir visage compact'),('968806','Nombre de pincettes','0'),('968806','Type de tête','NC'),('968806','Système anti-douleur','non'),('968806','Zone d\'application','Visage'),('968806','Utilisable sous l\'eau','Non'),('968806','Alimentation','Piles (non incluses)'),('968806','Autonomie','0'),('968806','Informations complémentaires','Le rasoir de poche Flawless est conçu pour éliminer le duvet en douceur et obtenir une peau lisse en toute liberté ! Design compact et élégant en forme de rouge à lèvres avec finition plaquée or 18 k. Utilisation :Le rasoir compact Flawless s\'adapte à toutes les zones du visage afin d\'obtenir une peau parfaitement lisse sans risque d’écorchure ou d’irritation.Il suffit d’appliquer une légère pression avec un mouvement circulaire pour éliminer le duvet en quelques instants. Ergonomique : Sa lampe LED vous offre une utilisation très pratique pour les poils clairs, difficiles à repérer. Son design compact et ultra léger vous permet de l\'emporter facilement partout avec vous. Discret, il trouvera facilement sa place dans votre sac à main !Alimentation :Il fonctionne avec une pile AA (non fournie) pour une utilisation facilitée et une totale liberté de mouvement.'),('968806','Dimensions produit','H 22 cm x L 11 cm x P 4 cm'),('968806','Dimensions colis','H 22 cm x L 11 cm x P 4 cm'),('968806','Poids net','0,09 kg'),('968807','Type d\'épilateur','Rasoir de précision Visage et Sourcils'),('968807','Nombre de pi