rrondies protègent les 27 lames auto-affûtées. Elles leur permettent de couper les poils en douceur juste au-dessus du niveau de la peau et facilitent une glisse parfaite du rasoir sur votre peau.Les têtes flottantes 3D sont mobiles, pour un rasage de près pratique :Obtenez un rasage de près pratique grâce aux têtes flottantes tri directionnelles. Elles sont mobiles, ce qui leur permet de s\'adapter aux courbes de votre visage et d\'assurer un contact régulier avec votre peau, sans pression excessive.AquaTec, pour un rasage pratique à sec ou rafraîchissant avec de la mousse :Bénéficiez d\'un rasage à sec pratique ou d\'un rasage plus confortable avec du gel ou de la mousse, même sous la douche.Ouverture d\'une simple pression pour faciliter le nettoyage :Nettoyez facilement le rasoir. Il vous suffit d\'appuyer sur un bouton pour ouvrir la tête de rasage et rincer à l\'eau.Indicateur de charge à 1 niveau pour obtenir le meilleur du rasoir :Consultez l\'indicateur intuitif pour savoir si la batterie du rasoir est faible, vide ou entièrement chargée.40 minutes d\'autonomie pour 8 h de charge :Bénéficiez d\'une autonomie de 40 minutes pour 8 heure de charge. Le rasoir fonctionne uniquement lorsqu\'il n\'est pas en cours de charge.Le système Skin Protection permet une glisse en douceur pour protéger la peau :Conçu pour éviter les coupures et irritations, pour un rasage de près protecteur. Grâce à ses bords arrondis, le système Skin Protection glisse en douceur sur votre peau afin de la préserver.Les 27 lames auto-affûtées assurent un rasage de près uniforme :Obtenez un rasage de près uniforme sans exception grâce aux 27 lames auto-affûtées bénéficiant d\'une technologie de précision.Forme ergonomique pour une manipulation pratique :Manipulez votre rasoir en toute confiance grâce à son design ergonomique qui facilite une bonne prise en main lors du rasage.Capot de protection pour maintenir la propreté de la tête de rasage entre deux utilisations :Protégez la tête de rasage et gardez-la propre entre deux utilisations ou lors de vos déplacements.'),('968926','Dimensions produit','H 19 cm x L 14 cm x P 7 cm'),('968926','Dimensions colis','H 19 cm x L 14 cm x P 7 cm'),('968926','Poids brut','0,75 kg'),('968927','Type d\'appareil','Déshumidificateur'),('968927','Déshumidifiant (L/24h)','12'),('968927','Surface traitée maxi (m²)','35 m²'),('968927','Capacité du réservoir (L)','2,1 L'),('968927','Débit d\'air (m³/h)','118'),('968927','Dimensions produit','H 89 cm x L 53,5 cm x P 69 cm'),('968927','Dimensions colis','H 25 cm x L 44 cm x P 36 cm'),('968927','Informations complémentaires','Idéal pièce 20 à 35m²'),('968927','Poids net','11,6 kg'),('968927','Poids brut','12,1 kg'),('968944','Type','Ampoule LED Connectée'),('968944','Descriptif complémentaire','TYPE DE PORT : E27DUREE DE VIE / Environ 25 000 heuresPUISSANCE NOMINALE : 8WConnecter au réseau pour pouvoir la contrôler depuis le smartphone via l\'application Mi HOME'),('968944','Poids net','0,21 kg'),('968949','Modèle','REDMI 9'),('968949','Système d\'exploitation','Android 10'),('968949','Surcouche','Oui'),('968949','Résolution de l\'écran','2340 x 1080p FHD+'),('968949','Technologie de l\'écran','IPS & Corning Gorilla Glass 3'),('968949','Taille écran en pouces','6,53'),('968949','Taille écran en cm','16,58 cm'),('968949','Nom du processeur','Helio G80'),('968949','Type de processeur','2.0 GHz Octa-core'),('968949','Mémoire vive (RAM)','4 Go'),('968949','Mémoire interne (ROM)','64 Go'),('968949','Extension de mémoire','extensible via port micro-SD (512 Go max)'),('968949','Compatibilité opérateurs','Tout opérateur'),('968949','Réseau','4G LTE'),('968949','Type de carte Sim','Dual SIM (2x nano)'),('968949','Compatibilité GPS','GPS&A-GPS&GLONASS'),('968949','WiFi','WiFi b/g/n'),('968949','Bluetooth','Bluetooth 5.0'),('968949','NFC','Oui'),('968949','Autonomie','NC'),('968949','Capacité de la batterie (mAh)','5 020'),('968949','Caméra arrière (Mpixels)','13+8+5+2MP/1080p'),('968949',