ue filière *Sortie audio : stéréo*Touches secret, volume*Poids :499g*Support :x-box one'),('969118','Informations complémentaires','Expérience : Le Nemesis a été fabriqué avec des haut-parleurs en néodyme de 40 mm pour couvrir parfaitement vos oreilles et offrir une isolation parfaite des bruits extérieurs.Communication : Microphone flexible avec une restitution sonore parfaite qui va de 20 Hz à 20 Khz afin de vous donner, ainsi qu\'à votre équipe, les meilleurs outils pour gagner.Confort : Grâce à son coussin épais et son bandeau durable et ajustable le casque Nemesis offre un réel confort et est idéal pour les longues sessions de jeu. Design : Sobre et parfaitement conforme aux couleurs de la Switch. Le casque se branche avec une prise 3,5 mm.'),('969119','Informations complémentaires','Expérience : Profitez d’un micro-casque abordable et universel compatible avec toutes les consoles et PC actuels. Avec son diaphragme de 40mm et une fréquence du casque de 20 Hz à 20 KHz immergez-vous totalement en jeu.Confort : Conçut dans un souci de confort optimal, le ARES CAMO profite de coussinets épais au niveau des oreilles et de l’arceau pour un confort et une isolation de tous les instants.Accessibilité : Le ARES possède un microphone flexible et inclinable de haut en bas jusqu’à 45°. Le casque se connecte directement à vos contrôleurs de consoles ou PC en Jack (Splitter fournit) et profite d’un câble tressé de qualité. Le contrôle du son se fait directement sur la télécommande sur le câble.Design : Profitez d’un design camouflage blanc/gris du plus bel effet qui saura vous rappeler vos plus grandes batailles multi-joueurs.'),('969120','Informations complémentaires','Housse équipée d’une poignée confortable pour le transport. Pratique et facile à utiliser pour les voyages.Une housse compatible avec la Switch et la Switch Lite 1 filet de rangement pouvant accueillir des petits accessoires supplémentaires comme un câble HDMI ou des Joy-Cons supplémentaires8 compartiments po