Nettoyage','Lavable entièrement sous l\'eau'),('969155','Accessoires','1 peigne de guidage'),('969155','Informations complémentaires','Personnalisez votre look selon le style de coupe que vous désirez.Avec la tondeuse BRAUN HC5010, vous bénéficiez d\'un sélecteur de longueur de coupe qui vous offre le choix entre 9 longueurs. Les hauteurs de coupe vont de 3 à 24 mm avec un pas de 3 mm pour varier les plaisirs entre cheveux très courts et coupes plus longues, selon vos envies du moment.La tondeuse BRAUN HC5010 est dotée de lames très affûtées. De cette manière, vous obtenez encore plus de précision, sans à-coups et sans sensation de tiraillement, même avec des cheveux épais. Les lames sont durables et solides, ce qui vous permettra d\'utiliser votre tondeuse longtemps, aussi souvent que vous le voulez.UNE TONDEUSE AVEC OU SANS FILTondeuse BRAUN HC5010 - 9 longueursVous pouvez aussi bien utiliser votre tondeuse BRAUN HC5010 avec ou sans fil. Branchez-la directement sur le secteur ou utilisez son système avec une double batterie NiMh, selon vos besoins. Son autonomie est de 50 minutes pour un temps de recharge de 8 heures. Le témoin de charge LED vous indique quand recharger votre tondeuse.Sachez également que la tondeuse BRAUN HC5010 se nettoie facilement. Pour cela, vous pouvez utiliser sa brosse de nettoyage, pratique pour ôter tous les petits cheveux dans les recoins. Il est aussi possible de simplement la laver sous l\'eau courante. Cette tondeuse est livrée avec un flacon d\'huile.Vous pouvez aussi bien utiliser votre tondeuse BRAUN HC5010 avec ou sans fil. Branchez-la directement sur le secteur ou utilisez son système avec une double batterie NiMh, selon vos besoins.Son autonomie est de 50 minutes pour un temps de recharge de 8 heures. Le témoin de charge LED vous indique quand recharger votre tondeuse.Sachez également que la tondeuse BRAUN HC5010 se nettoie facilement. Pour cela, vous pouvez utiliser sa brosse de nettoyage, pratique pour ôter tous les petits cheveux dans les recoins. Il est aussi possible de simplement la laver sous l\'eau courante. Cette tondeuse est livrée avec un flacon d\'huile.'),('969155','Dimensions colis','H 6 cm x L 25 cm x P 14 cm'),('969155','Poids brut','0,8 kg'),('969156','Autonomie (min)','150 mn'),('969156','Programmable','Oui, et connecté par téléphone, wifi'),('969156','Détection des obstacles','Oui'),('969156','Niveau Sonore (dB)','58 dB'),('969156','Accessoires','Notice, Base de chargement, Câble d\'alimentation, Réservoir amovible, Mur virtuel: 1, Batterie'),('969156','Descriptif complémentaire','Navigation LiDAR de précision et parcours de nettoyage en forme de Z : cartographie efficace et détaillée de la maison et nettoyage complet.Nettoyage sélectif et pratique de pièces : choisissez les pièces à nettoyer et programmez le nettoyage pour des pièces spécifiques.Réservoir d\'eau réglable à longue portée de 180 ml : convient pour nettoyer les maisons jusqu\'à 150 m2, réglable pour différents types de sols.Forte Aspiration de 2000Pa et Système Multi-mode : Moquette, Silencieux, Serpillère, équilibré, mode Turbo & Max. Votre aspirateur vous offre la flexibilité nécessaire pour basculer entre différents modes et nettoyer efficacement les différents types de plancher. Profitez de votre temps de nettoyage.Contrôle avancé au moyen de l\'application : définissez des zones interdites, des murs invisibles, etc., et utilisez la commande vocale avec Alexa et Google Home.'),('969156','Poids net','5,8 kg'),('969156','Poids brut','7,2 kg'),('969156','Dimensions produit','H 9,65 cm x L 35 cm x P 35,5 cm'),('969156','Dimensions colis','H 20 cm x L 60 cm x P 60 cm'),('969167','Type d\'appareil','Lisseur boucleur'),('969167','Puissance (W)','56 W'),('969167','Largeur des plaques','2,4 cm'),('969167','Revêtement des plaques','DEEP BLACK CERAMIC'),('969167','Réglage de la température','Oui'),('969167','Prêt en','30 secondes'),('969167','Température minimale (°C)','150°C'),('969167','Température maximale (°C)','230°C'),('969167','Accessoires','Pochette Thermorésistante'),('969167','Informations complémentaires','Un outil de styling multifonctions qui lisse, boucle ou ondule;Doté de plaques en céramique incurvées , il permet une définition optimale des boucles;Son dos en métal chauffant protégé confère aux boucles une tenue extra longue tout en évitant les risques de brûlures accidentelles.Avec une température réglable de 150°C à 230°C, il s’adapte à tous types de cheveux.Le résultat : Des cheveux lissés, bouclés ou ondulés en toute simplicité sans risque de brûlures.'),('969167','Dimensions colis','H 12,5 cm x L 33 cm x P 6,6 cm'),('969167','Poids brut','0,82 kg'),('969169','Type de rasoir','Rasoir 3 grilles'),('969169','Autonomie (min)','50 mn'),('969169','Type de tête','Flexible Baldes'),('969169','Référence tête','NC'),('969169','Alimentation','Batterie'),('969169','Temps de charge (min)','1 h'),('969169','Indicateur de charge','Oui'),('969169','Lavable sous l\'eau','Oui, 100% étanche'),('969169','Nettoyage','Lavable entièrement sous l\'eau/étanche'),('969169','Accessoires','Embout tondeuse precision'),('969169','Informations complémentaires','Flexible Blades: 3 éléments de coupe flottants et indépendantsTechnologie SensoFlex: Tête pivotante qui s’adapte à toutes les zones du visage pour un confort de rasage optimal.Easy Clean: Système de nettoyage sous l\'eau simplifié; plus besoin de retirer la tête.Wet & Dry: 100% étanche, avec une utilisation sur peau humide ou peau sèche, avec ou sans mousse à raser.Quick Charge: Permet de recharger le rasoir en 5 min pour assurer un rasage complet.Autonomie 50 min: La batterie fournit une puissance continue, avec une charge complète en 1h.Easy Click: Pour clipser tous les accessoires en fonction de vos besoinsTondeuse de précision : Pour une taille parfaite de la moustache et des pattesHousse de rangement'),('969169','Dimensions colis','H 25,2 cm x L 13,7 cm x P 6,7 cm'),('969169','Poids brut','0,454 kg'),('969169','Disponibilité pièces détachées (données fournisseur)','5 ans date d\'achat'),('969171','Type','PACK XBOX1 + 5JEUX'),('969171','Informations complémentaires','BUNDLE CONSOLE XBOX ONE S 1TO + JEU GEARS 5 + JEU FORZA HORIZON 4 + JEU GTA V + JEU BATMAN ARKHAM KNIGHT + JEU MORTAL KOMBAT X Console Xbox One S 1To Plus belle, plus fine, plus performante Découvrez la nouvelle Xbox One S.  Jouez au catalogue de jeux le plus fabuleux, y compris aux classiques Xbox 360, sur une console 40 % plus petite.  Profitez de couleurs plus intenses et plus lumineuses dans des jeux et des vidéos en HDR.  Diffusez vos vidéos 4K en continu sur Netflix, ou regardez vos films Blu-Ray ultra HD en 4K.  Gears 5 Issus d’une des sagas les plus populaires de l’histoire, Gears 5 nous propose une campagne épique et de l’action brutale grâce aux 5 nouveaux modes.  Forza Horizon 4 Vivez une expérience de pilotage unique dans un monde ouvert où les saisons changent de manière dynamique pour la première fois dans un jeu de course. Traversez des paysages étonnants, collectionnez plus de 450 voitures et devenez la Superstar Horizon de Grande Bretagne.  GTA V Explorez le monde éblouissant de Los Santos et Blaine County dans la meilleure expérience de Grand Theft Auto V, comprenant un éventail d’améliorations techniques et de nouveautés pour les nouveaux joueurs mais aussi les anciens. En plus d’une profondeur de champs accrue et d’une résolution supérieure, les joueurs découvriront un ensemble d’ajouts et d’améliorations comprenant : - Nouvelles armes, véhicules et activités - Nouvelle faune et flore - Circulation plus dense - Nouveau système de végétation - Effets de dégâts et de météo plus persistants, et bien plus encore  BATMAN ARKHAM KNIGHT  Vivez pleinement l\'expérience Batman alors que le Chevalier noir entame le dernier chapitre de la trilogie. Les joueurs pourront devenir les meilleurs enquêteurs du monde grâce à l\'ajout de la Batmobile et à l\'amélioration de certaines fonctions caractéristiques de la série comme le système de combat \'FreeFlow\', la furtivité, les enquêtes médico-légales et la navigation.   Mortal Kombat X Mortal Kombat est de retour pour une expérience encore plus brutale !  Mortal Kombat X combine des graphismes dignes de cinématiques à un tout nouveau gameplay pour offrir les Kombats les plus brutaux jamais réalisés.  Pour la première fois, les joueurs ont le choix parmi les nombreuses versions de chaque personnage, chacune avec son propre style de combat et ses stratégies.  Et grâce aux nouvelles fonctions connectées, les joueurs participent en permanence à un tournoi mondial en ligne où chaque Kombat compte dans la bataille pour la victoire !  Les joueurs découvriront également un scénario inédit faisant intervenir certains des personnages les plus récurrents du jeu dont Scorpion et Sub-Zero, ainsi que de nouveaux combattants représentant les forces du bien et du mal.'),('969171','Dimensions colis','H 40 cm x L 60 cm x P 60 cm'),('969171','Poids brut','4,288 kg'),('969170','Type','Drône connecté'),('969170','Informations complémentaires','Drône pour caméra universelle  4 moteurs brushed  6 axes gyroscope  Fonction altimètre: permet de maintenir l’altitude en mode automatique  Fonction atterrissage et décollage automatique  3 vitesses sélectionnables  Vitesse maximum: 12,5 m/s  Autonomie en vol: 13 à 15 minutes  Fonction Flip 3D 360° et retour Point de départ  Eclairage en vol par Led clignotantes  Possibilité d’ajouter une caméra sport sur support universel (fourni)  Dimensions: 50x50x19 cmAccessoires inclus:  Télécommande 2,4 GHz Distance de communication maximale: 150 mètres  Batterie 2000 mAh Lithium Temps de charge:120 min Durée de vol ≥ 10 min  Chargeur secteur  4 hélices de rechange et 4 protections inclusesTAKARA Multimédia- Mail: contact@takara.fr'),('969170','Dimensions colis','H 30 cm x L 48,6 cm x P 8,6 cm'),('969170','Poids brut','1,88 kg'),('969170','Disponibilité pièces détachées (données fournisseur)','3 ans date d\'achat'),('9