dormir. Consultez vos appels ou SMS et recevez des notifications directement sur l’écran tactile.Grace à son mode sport, vous pouvez choisir le type de sport et obtenir des statistiques à la suite de votre séance. Le suivi d’activité vous permettra de suivre le nombre de pas par jour ainsi que le nombre de calories brûlées et la distance parcourue. Vous pouvez utiliser l\'application pour visualiser plus intuitivement vos données de santé à plusieurs reprises.Profitez du GPS pour voir les résultats de course ou randonnée en temps réel, telle que l’allure et la distance parcourue puis visualiser votre itinéraire sur une carte dans l’application « VeryFitPro ». D’autres fonctionnalités viennent compléter cette montre : podomètre, chronomètre, réglage d’une alarme, météo, « trouver son téléphone ». Vous pouvez également jouer la musique de votre téléphone. Profitez de moments de calme dans votre journée grâce à des séances de respiration personnalisées basées sur votre fréquence cardiaque. Apprenez à mieux connaître votre corps en utilisant la fonction « santé des femmes » pour enregistrer vos règles, noter vos symptômes, prévoir vos périodes d\'ovulation et découvrir les tendances de votre cycle.'),('969232','Dimensions produit','H 11 cm x L 8,4 cm x P 5,8 cm'),('969232','Dimensions colis','H 11 cm x L 8,4 cm x P 5,8 cm'),('969232','Poids brut','0,16 kg'),('969233','Type','Montre connectée'),('969233','Informations complémentaires','GPSSuivi du sommeilPodomètreSuivi du rythme cardiaquemode entrainementnotifications des alertes et des messagesnotifications des appelsAutonomie 6 joursBluetoothfonction réveil-	Taille de l’écran : 1,3 pouces-	Resistance à l’eau : 5ATM -	Taille de la montre : 250*37*12mm-	Taille du cadran : 42*37*12mm-	Poids : 35g -	Résolution de l’écran : 240*240-	Batterie : 210mAh -	Durée d’autonomie : o	En utilisation : 7 jours o	En Standby : 40 jours-	Type de chargement : Chargeur magnétique-	Compatibilité :o	IOS 8.0+o	Android 4.4+ Un allié forme et sa