6'),('969388','Taille écran en cm','39,624 cm'),('969388','Résolution de l\'écran','1920 x 1080 FHD'),('969388','Format de l\'écran','16/9'),('969388','Type de dalle','IPS'),('969388','Taux de luminosité (Cd/m²)','250 (Cd/m²)'),('969388','Temps de réponse (ms)','5ms'),('969388','Angle de vision horizontal','178°'),('969388','Angle de vision vertical','178°'),('969388','Connectique','USB-C'),('969388','Accessoires','câble USB-C'),('969388','Haut-parleur','Non'),('969388','Fréquence de balayage (Hz)','70 Hz'),('969388','Pied inclinable','Non'),('969388','Ajustable en hauteur','Non'),('969388','Consommation en fonction (W)','8 W'),('969388','Consommation en veille (W)','0 W'),('969388','Poids net','0,71 kg'),('969388','Poids brut','2 kg'),('969388','Coloris','Noir et gris'),('969388','Informations complémentaires','Élargissez vos horizons. Brisez vos chaînes.Le ASUS ZenScreen MB16ACE est conçu pour améliorer votre productivité, même lors de vos déplacements. Il s\'agit du premier moniteur portable équipé d\'une solution de signal hybride : grâce à un seul câble USB, il est entièrement compatible avec presque tous les ordinateurs portables ! Avec son profil fin de 8 mm il ne pèse que 0,71 kg, faisant de lui l\'écran portable de 15,6 pouces le plus léger au monde.Solution de signal hybride : Compatible avec les ports USB de Type-C et de Type-AQue ce soit pour l\'alimentation ou les transferts vidéo, le ZenScreen MB16ACE ne nécessite qu\'une seule connexion USB. Son innovante solution de signal hybride est compatible avec les ports USB Type-C (USB-C). Pour une meilleure compatibilité, le moniteur utilise un pilote installé supportant les ports USB Type-A. Le design du port USB-C réversible vous offre un branchement ultra-rapide et simple à tout autre appareil.Un design fin, élégant et ultra-compactParfait en tant qu\'écran secondaire lorsque vous réalisez des présentations sur deux moniteurs, le ZenScreen MB16ACE améliorera votre efficacité. Avec un poids de 0,71 kg seulement et un profil fin de 8 mm, une chose est sûre : il ne sera pas un fardeau !Orientation automatique de l\'écranGrâce à son logiciel DisplayWidget, le ZenScreen MB16ACE détecte automatiquement dans quelle position il est, afin de passer facilement en mode portrait ou paysage. Le mode Paysage est parfait pour vos présentation ou pour mieux afficher un tableau Excel, tandis que le mode Portrait vous offre une excellente lisibilité de vos documents, e-books ou sites internet pour mobiles.Angle de vision largeLe ZenScreen MB16ACE présente une dalle Full HD avec une résolution de 1920 x 1080 et une reproduction fidèle des couleurs. Il intègre la technologie IPS pour vous offrir une meilleure flexibilité lorsque vous agrandissez votre écran : l\'affichage propose des couleurs et contrastes exceptionnels, même lorsque vous êtes excentré par rapport à l\'écran.Pochette pliable ASUS Smart CaseLa pochette ASUS Smart Case protège votre ZenScreen MB16ACE de la poussière et des chocs. Elle peut servir de support réglable pour utiliser votre moniteur portable en mode Portrait ou Paysage. Un support pour stylet est intégré en bas à droite du ZenScreen MB16ACE : glissez-y un stylet qui pourra également maintenir votre moniteur à la verticale lorsque vous n\'utilisez pas la pochette Smart Case.Protégez vos yeux avec la technologie ASUS Eye CareASUS Blue Light FilterLa technologie exclusive ASUS Ultra-Low Blue Light vous préserve de la lumière bleue. Elle propose quatre filtres de lumière bleue facilement accessibles sur le menu à l\'écran via les raccourcis.Technologie ASUS Flicker-FreeIl est temps de dire adieu à la fatigue oculaire. Le ZenScreen MB16ACE intègre la technologie ASUS Flicker-Free, certifiée par TÜV Rheinland, pour réduire le scintillement et créer une expérience visuelle confortable. Cette technologie réduit la fatigue des yeux et les autres effets néfastes que peuvent subir ceux qui passent de longues heures devant leurs écrans.Ordinateur portable non inclus.'),('