uverture   • 1 compartiment pour votre console et vos joy-con • 1 filet de rangement pour accessoires  • Rangez jusqu’à 14 cartouches de jeux  • 1 dragonne de transport  • Design Licorne'),('969422','Dimensions colis','H 9 cm x L 23 cm x P 12 cm'),('969422','Poids brut','0,88 kg'),('969427','Alarme','Alarme'),('969427','Répétition de l\'alarme','Oui'),('969427','Projection plafond','Oui'),('969427','Couleur de l\'affichage','noir'),('969427','Gamme d\'ondes','non'),('969427','Alimentation','PILES'),('969427','Nombre de stations mémorisables','0'),('969427','Nombre de piles','3'),('969427','Référence piles','3*AAA'),('969427','Tuner Radio','Non'),('969427','Coloris','Bleu et Rouge'),('969427','Dimensions produit','H 11,8 cm x L 11 cm x P 9,1 cm'),('969427','Dimensions colis','H 14,6 cm x L 10 cm x P 10,7 cm'),('969427','Poids net','0,11 kg'),('969427','Poids brut','0,21 kg'),('969454','Adaptateur fourni','Oui'),('969454','Prise micro','Oui'),('969454','Descriptif complémentaire','Entrée microAfficheur led128 sonorités4 touches de percussion et son d\'animaux30 chansons de demoMetronome2 fonctions d\'apprentissage3 mémoires pour les réglages de l\'utilisateurStart / stop / Sync / Fill-in / contrôle du tempoProgrammation du rythme / Enregistrement & LectureVibrato / Maintien de la note / TransposerAccords à un doigt / Accords doigtésClavier divisible en 2 parties Sortie pour casque ou amplificateur/système audio externechargeur inclus'),('969454','Dimensions produit','H 10 cm x L 90 cm x P 33 cm'),('969454','Poids net','3,9 kg'),('969454','Coloris','Noir et silver'),('969456','Type','Controleur DJ 4 VOIES'),('969456','Nombre de sorties','4'),('969456','Poids net','3,8 kg'),('969456','Poids brut','5,2 kg'),('969456','Dimensions produit','H 68,7 cm x L 67,6 cm x P 34,57 cm'),('969456','Dimensions colis','H 44,5 cm x L 76 cm x P 42,1 cm'),('968916','Type','Grill'),('968916','Posable / Encastrable','Posable'),('968916','Capacité (L)','37 L'),('968916','Puissance du micro-o