 années d\'utilisation.'),('969507','Accessoires','Câble USB, adaptateur secteur, kit piéton'),('969507','Dimensions produit','H 16,49 cm x L 7,07 cm x P 0,9 cm'),('969507','Dimensions colis','H 5 cm x L 9 cm x P 17 cm'),('969507','Poids','196g'),('969507','Poids brut','0,41 kg'),('969507','Catégorie mobile','Neuf'),('969507','DAS Tête (W/kg)','0,37'),('969507','DAS tronc (W/kg)','1,14'),('969507','DAS Membres (W/kg)','2,28'),('969507','DAS texte réglementaire','Le débit d\'absorption spécifique (DAS) local quantifie l\'exposition de l\'utilisateur aux ondes électromagnétiques à puissance maximale de l\'équipement concerné. Le DAS maximal autorisé est de 2 W/kg pour la tête et le tronc et de 4 W/kg pour les membres'),('969507','Disponibilité pièces détachées (données fournisseur)','2 ans date d\'achat'),('969508','Modèle','REDMI 9'),('969508','Système d\'exploitation','Android 10'),('969508','Surcouche','Oui'),('969508','Résolution de l\'écran','2340 x 1080p FHD+'),('969508','Technologie de l\'écran','IPS & Corning Gorilla Glass 3'),('969508','Taille écran en pouces','6,53'),('969508','Taille écran en cm','16,58 cm'),('969508','Nom du processeur','Helio G80'),('969508','Type de processeur','2.0 GHz Octa-core'),('969508','Mémoire vive (RAM)','4 Go'),('969508','Mémoire interne (ROM)','64 Go'),('969508','Extension de mémoire','extensible via port micro-SD (512 Go max)'),('969508','Compatibilité opérateurs','Tout opérateur'),('969508','Réseau','4G LTE'),('969508','Type de carte Sim','Dual SIM (2x nano)'),('969508','Compatibilité GPS','GPS&A-GPS&GLONASS'),('969508','WiFi','WiFi b/g/n'),('969508','Bluetooth','Bluetooth 5.0'),('969508','NFC','Oui'),('969508','Autonomie','NC'),('969508','Capacité de la batterie (mAh)','5 020'),('969508','Caméra arrière (Mpixels)','13+8+5+2MP/1080p'),('969508','Caméra frontale (Mpixels)','8MP'),('969508','Radio FM','Oui'),('969508','Connectiques','USB-C'),('969508','Jack 3.5 mm','Oui'),('969508','Boitier','Plastique'),('969508','Résistance',