ncore plus fluide et réactif.* Le temps de réponse de 0,5 ms est le taux minimal enregistré après les tests menés en interne. Le temps de réponse est susceptible de varier en fonction des conditions lors des tests.Le moniteur ASUS VG248QG intègre la fonction exclusive ASUS GamePlus, un raccourci qui vous permet de bénéficier d\'améliorations directement dans vos jeux et ainsi jouer à votre plein potentiel.Cette fonction a été développée avec la participation de pro-gameurs, leur permettant de pratiquer et améliorer leurs talents.e moniteur ASUS VG248QG intègre la fonction exclusive ASUS GamePlus, un raccourci qui vous permet de bénéficier d\'améliorations directement dans vos jeux et ainsi jouer à votre plein potentiel.Cette fonction a été développée avec la participation de pro-gameurs, leur permettant de pratiquer et améliorer leurs talents.Le ASUS VG248QG dispose de multiples ports, dont un port dual-link DVI-D, DisplayPort 1.2 et HDMI (v1.4), pour le brancher à de multiples appareils multimédia. Par ailleurs, son cadre fin de 1 cm facilite l\'immersion dans une configuration panoramique composée de plusieurs écrans.L\'outil de gestion des câbles, sur le pied du VG248QG, vous permet de ranger et dissimuler vos câbles pour jouir d\'un espace de jeu épuréLa technologie ASUS Ultra-Low Blue Light réduit la quantité de lumière bleue. Avec le menu OSD ou DisplayWidget UI, sélectionnez facilement quatre différents paramètres de filtrage selon la tâche que vous effectuez.Le moniteur gaming ASUS VG248Q est spécialement conçu pour vos longues sessions de jeu. Son support ergonomique permet de régler l\'inclinaison, la rotation, le pivotement et la hauteur de l\'écran afin de toujours trouver la position idéale. Il peut également être monté à un mur avec un support VESA afin de s\'adapter même aux espaces les plus confinés.'),('969679','Descriptif complémentaire','Ajustable en hauteur et à la verticaleNvidia G-syncmode jeux'),('969679','Dimensions produit','H 35,9 cm x L 56