9721','Capacité de la batterie (mAh)','3 110'),('969721','Caméra arrière (Mpixels)','12+12MP/4K'),('969721','Caméra frontale (Mpixels)','12MP/4k'),('969721','Lecteur multimedia','FLAC, H.264, MP3, HEVC'),('969721','Radio FM','Non'),('969721','Connectiques','lightning ®'),('969721','Jack 3.5 mm','Non'),('969721','Boitier','Cadre Aluminium & Dos verre'),('969721','Résistance','Eau et poussière'),('969721','Coloris','Rouge'),('969721','Descriptif complémentaire','° Pour rater une photo, il faut vraiment le vouloir.Tout nouveau double appareil photo. Format XL ou XXL ? Pour chaque image, c’est vous qui voyez. La nouvelle interface utilise l’appareil ultra grand-angle pour vous montrer ce qui se passe hors cadre : vous avez toujours la globalité de la scène sous les yeux et vous pouvez changer d’appareil d’un toucher pour immortaliser l’ensemble. Il est même possible de retoucher vos vidéos comme vous le faites avec vos photos. Décidément, l’appareil photo le plus populaire au monde ne cesse de se réinventer pour vous offrir de nouvelles perspectives.° Découvrez le mode Nuit. Prendre une photo dans un lieu un peu sombre ne signifie plus forcément se retrouver avec un monochrome noir. Le mode Nuit est une toute nouvelle fonctionnalité qui s’active automatiquement pour vous permettre de réussir vos photos en conditions de faible éclairage. Pas besoin de flash : les couleurs sont plus naturelles et les photos, plus lumineuses.° Tant de réalisme, c’est surréaliste.- LCD Liquid Retina. Sur l’écran bord à bord, tout est superbement fidèle à la réalité. Et superbe tout court.- True Tone. Il règle la balance des blancs pour s’adapter à la température des couleurs de l’environ­nement lumineux dans lequel vous vous trouvez.- Toucher ou lever pour réactiver. Votre iPhone est prêt en un instant.- Haptic Touch. Faites plus vite toutes sortes de choses essentielles grâce à des menus contextuels et à des raccourcis.° Le plein d’énergie pour la journée.Autonomie d’une journée. Matériel et logiciels s’associent pour tirer le meilleur parti de votre batterie. Et la recharge rapide vous permet de refaire le plein plus rapidement.° Un téléphone pas comme les autres. Jusqu’au dernier jour.La valeur de l’iPhone reste intacte plus longtemps. Chaque iPhone est fabriqué à partir de matériaux de première qualité et conçu pour durer. Mais quand – hélas – l’heure des adieux arrive, l’idéal est de le faire reprendre pour en acheter un autre. Votre ancien iPhone trouvera un nouveau propriétaire ou sera recyclé.'),('969721','Accessoires','Câble USB, adaptateur secteur, kit piéton'),('969721','Dimensions produit','H 15,09 cm x L 7,57 cm x P 0,83 cm'),('969721','Dimensions colis','H 7,5 cm x L 7,5 cm x P 16 cm'),('969721','Poids','194g'),('969721','Poids brut','0,3 kg'),('969721','Catégorie mobile','Neuf'),('969721','DAS Tête (W/kg)','0,95'),('969721','DAS tronc (W/kg)','0,99'),('969721','DAS Membres (W/kg)','3,2'),('969721','DAS texte réglementaire','Le débit d\'absorption spécifique (DAS) local quantifie l\'exposition de l\'utilisateur aux ondes électromagnétiques à puissance maximale de l\'équipement concerné. Le DAS maximal autorisé est de 2 W/kg pour la tête et le tronc et de 4 W/kg pour les membres'),('969706','Type','ENCEINTE AUTONOME'),('969706','Puissance (W)','200 W'),('969706','Connectiques','USB,SD,AUX in,BLUETOOTH'),('969706','Alimentation','BATTERIE'),('969706','Tuner Radio','Non'),('969706','Bluetooth','Oui'),('969706','Version bluetooth','5.0'),('969706','Autonomie','4H'),('969706','Descriptif complémentaire','2 boomers 13cm, TWS, micro inclus, LED'),('969706','Poids net','2,5 kg'),('969706','Coloris','Noir'),('969706','Dimensions produit','H 44 cm x L 18 cm x P 18 cm'),('969710','Modèle','Alcatel 1S'),('969710','Système d\'exploitation','Android 9 Pie'),('969710','Surcouche','Non'),('969710','Résolution de l\'écran','1440 x 720 HD+'),('969710','Technologie de l\'écran','IPS & Verre 2.5D'),('969710','Taille écran en pouces','5,5'),('969710','Taille